03", "name": "Amdocs Inc", "profile_url": "http://www.linkedin.com/company/amdocs"}]}, {"end": "July 2014", "description": "Worked as a service engineer in Ericsson Global India Pvt. Ltd.", "title": "RF Optimization Engineer", "start": "April 2013", "duration": "1 year 4 months", "organization": [{"unique_id": "f31628ac5883ea3a", "name": "Ericsson India Global services pvt. ltd.", "profile_url": "http://www.linkedin.com/company/ericsson"}]}, {"end": "April 2013", "title": "Nw Design and Optimization Engineer", "start": "October 2012", "location": "Chennai Area, India", "duration": "7 months", "organization": [{"unique_id": "6dcd82e693885853", "name": "Nokia Siemens Networks", "profile_url": "http://www.linkedin.com/company/nokianet"}]}, {"end": "July 2012", "description": "NSN (AIRTEL, ROB) WCDMA & GSM.\n\n\n Job Responsibilities:\n Responsible for meeting the target KPI for the parameters like Ec/io, RSCP, HSDPA and R99 throughput, Pilot pollution.\n Verification/Audit of Parameter DUMP, Analysis of Network Quality Report, Handover Performance report.\n Rectification of Inconsistencies & discrepancies found in analysis of Dump/Database\n Handling a Team of 4 Field Engineers for Optimization of the Clusters FOR CITY SWAP AND AT.\n Responsible for complete AT documentation with all network parameters report preparation and submission.\n KPI monitoring of NSN NETWORK (AIRTEL - ROB).\n CDD preparation for the new sites.\n Post Swap Network performance comparison & monitoring.\n Frequency Planning & Neighbor Planning.\n Physical Optimization by reorientation, Antenna down tilt & Antenna height reduction/increase\n Coverage analysis and Speech Quality analysis\n Analysis of Drive Test Data using TEMS DISCOVERY(3.0.3), TEMS Route Analysis, MapInfo Professional 9.0.", "title": "Sr. R.F.Engineer", "start": "February 2012", "duration": "6 months", "organization": [{"name": "LINKQUEST TELECOM LTD"}]}, {"end": "January 2012", "description": "Projects: ERICSSON ,AIRTEL(DELHI/NCR); Responsible for meeting the target DT parameters like Ec/Io, RSCP, HSDPA, HSUPA and R99 throughput, Pilot pollution.\n Process LTE SSV & Cluster Reports by using MAPINFO parameters like RSRP, RSRQ, Best Server (PCI), SINR, HSDPA & HSUPA.\n KPI monitoring for the Network Availability, RRC, RAB for voice and video, SHO and IRAT handover performance.\n Identifying potentially week area on the basis of RSSI, handover failure, call drops, Ec/Io worst, throughput and optimize that area by tilt, orientation, Dump analyses, checking Handover parameters and definition.\n Preparing cluster route for Drive Test by using MAP INFO and Google earth.\n Analyzing of Drive Test Data using TEMS Discovery, RENOPT and MapInfo Professional 9.0 and optimizing the faults by recommending change in neighbors, neighbors parameters and tilt change until the required KPIs meet.\n Troubleshooting problems like missing neighbors, coverage holes, pilot pollution, area of no dominance, code plan problems, overshooting sites etc. through drive log analysis.\n RF coverage optimization using antenna tilt and azimuth fine tuning for optimal coverage overlap and reduction of pilot pollution to improve Ec/Io to get better throughput.\n Recommendation of neighbor optimization and physical optimization to achieve desired Pilot coverage.\n Perform initial RF tuning and optimization based on drive test result to improve RF coverage, eliminate pilot pollution, detect missing neighbor and compare before/after drive test to verify the adjustment.\n Responsible for report preparation to be done by the data processers and the reports submission to the client.\n Knowledge of Drive test of 4G(LTE) network on CMP\n Knowledge of Drive test of 3G (WCDMA) network on TEMS.\n Knowledge of Drive test of 2G (GSM) network on TEMS.\n WCDMA Handovers creation and deletion in RNC.\n Data drive Test for LTE,WCDMA and GSM network", "title": "RF ENGINEER", "start": "December 2010", "duration": "1 year 2 months", "organization": [{"name": "INFINTIE TELESOLUTIONS PRIVATE LTD"}]}, {"end": "January 2012", "description": "Projects: ERICSSON ,AIRTEL(DELHI/NCR); Responsible for meeting the target DT parameters like Ec/Io, RSCP, HSDPA, HSUPA and R99 throughput, Pilot pollution.\n Process LTE SSV & Cluster Reports by using MAPINFO parameters like RSRP, RSRQ, Best Server (PCI), SINR, HSDPA & HSUPA.\n KPI monitoring for the Network Availability, RRC, RAB for voice and video, SHO and IRAT handover performance.\n Identifying potentially week area on the basis of RSSI, handover failure, call drops, Ec/Io worst, throughput and optimize that area by tilt, orientation, Dump analyses, checking Handover parameters and definition.\n Preparing cluster route for Drive Test by using MAP INFO and Google earth.\n Analyzing of Drive Test Data using TEMS Discovery, RENOPT and MapInfo Professional 9.0 and optimizing the faults by recommending change in neighbors, neighbors parameters and tilt change until the required KPIs meet.\n Troubleshooting problems like missing neighbors, coverage holes, pilot pollution, area of no dominance, code plan problems, overshooting sites etc. through drive log analysis.\n RF coverage optimization using antenna tilt and azimuth fine tuning for optimal coverage overlap and reduction of pilot pollution to improve Ec/Io to get better throughput.\n Recommendation of neighbor optimization and physical optimization to achieve desired Pilot coverage.\n Perform initial RF tuning and optimization based on drive test result to improve RF coverage, eliminate pilot pollution, detect missing neighbor and compare before/after drive test to verify the adjustment.\n Responsible for report preparation to be done by the data processers and the reports submission to the client.\n Knowledge of Drive test of 4G(LTE) network on CMP\n Knowledge of Drive test of 3G (WCDMA) network on TEMS.\n Knowledge of Drive test of 2G (GSM) network on TEMS.\n WCDMA Handovers creation and deletion in RNC.\n Data drive 