orcing systems, policies, and procedures. Monitoring and scheduling work for office boys and drivers.\n \u2022Transportation and Vehicle management \u2013 Monitoring and ensuring timely punctuality off office buses and office vehicles. Allocation of office vehicles to guest and management.\n \u2022Purchase - Provides supplies by identifying needs from management, for reception, transportation, mailroom, and guesthouse. Purchases printed materials and forms by obtaining requirements; negotiating price, quality, and delivery; approving invoices. Monitoring and executing renewal of contracts for service provider venders like AMC.\n \u2022Security and Housekeeping Management \u2013 Ensuring smooth functioning of House Keeping, Transportation, and Security and Guest House facility.\n \u2022Ticketing and Hotel Accommodations - Maintains and ensures hassle free Ticketing, Visa Processing, Hotel accommodations and car services for Management and Guests.\n \u2022Contributes to team effort by accomplishing related results as needed.\n \u2022Ensuring organization adheres to all the statutory compliances.\n\n \u27a2 Procurement:\n \u2022Purchases for the Government Projects from the OEM.\n \u2022Vender management\n \u2022Collection of quotations and evaluation of the same.\n \u2022Negotiation with the vendors and finalizing the orders.\n \u2022Taking care of projects logistics.\n \u2022Coordinating with the vendors for the deliveries of the Projects Purchases.", "title": "Manager - Administration", "start": "August 2013", "location": "Mumbai Area, India", "duration": "3 months", "organization": [{"unique_id": "6a466a017e733a4b", "name": "Core Education & Technologies Limited", "profile_url": "http://www.linkedin.com/company/core-education-&-technologies-limited"}]}, {"end": "2009", "description": "\u2022 Responsible for all commercial activities.\n \u2022 Dealing with property dealers for purchase of new office space as well as leasing out company's property.\n \u2022 Responsible for registration of company's unit under STPI Scheme, /MSI\n \u2022 Registration and Adjudication of Properties.\n \u2022 Responsible for Procurement activity and Admin Activity", "title": "Asst. Manager - Procurement & Logistics", "start": "2004", "location": "Mumbai Area, India", "duration": "5 years", "organization": [{"unique_id": "6a466a017e733a4b", "name": "Core Projects & Technologies Ltd.", "profile_url": "http://www.linkedin.com/company/core-education-&-technologies-limited"}]}], "summary": "14+ Years of Experience in Administrative, Procurement, Liasioning & Land Acquisition.\n Administration,Staff Management,Facility Management,Transportation Management,Travel & Accommodation and Vendor Management.", "languages": [{"name": "English"}, {"proficiency": "Native or bilingual proficiency", "name": "Marathi"}, {"name": "Hindi"}], "_key": "IN59fe40506add55fb", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/AAEAAQAAAAAAAAk7AAAAJDZhZjM0NDFiLWJjZWQtNDhhYi1iMzdiLWEwYmViYjg2MDg0YQ.jpg", "given_name": "Khanderao", "url": "http://www.linkedin.com/in/khanderaodesai", "skills": ["Procurement", "Administrative Work", "Commercial Real Estate", "Negotiation", "Team Management", "Software Documentation", "Vendor Management", "Sourcing", "Project Management", "Management", "Team Building", "Real Estate", "Project Planning", "Business Development", "Business Development", "Training", "Logistics", "CRM"], "unique_id": "59fe40506add55fb"}
