e Stream Mapping, SIPOC, Customer and Vendor Surveys ,Ishikawa diagrams, Cause effect matrix, Process Door/Data Door analysis.", "title": "Summer Intern", "start": "April 2014", "duration": "2 months", "organization": [{"unique_id": "e2c3946c2516f9c7", "name": "MetLife", "profile_url": "http://www.linkedin.com/company/metlife"}]}, {"end": "July 2013", "description": "Projects\n\n Compliance\n Involved in developing Disclosures system, an application used by Nomura compliance department to calculate and report firm positions held in various securities.\n Involved in requirement gathering and development of reports enabling Nomura compliance department to submit reports to regulators in different countries.\n\n Global IT Budgeting\n Designed and developed budgeting application, enabling CAOs and project managers to budget and forecast human and technology resources.\n Implemented a robust design to control user access based on multidimensional parameters.\n Implemented complex accounting principles like Software capitalization and amortization inter- company recharges and intra - company recharges.\n\n IT Governance\n Designed and developed a firm wide application for Project and Portfolio management.\n Involved in requirement gathering and development of automated reports to senior management at Nomura.\n Developed rich GUI enabling users to generate project reports.", "title": "Analyst", "start": "July 2010", "location": "Mumbai Area, India", "duration": "3 years 1 month", "organization": [{"unique_id": "28a469476dcf1466", "name": "Nomura", "profile_url": "http://www.linkedin.com/company/nomura"}]}], "languages": [{"proficiency": "Professional working proficiency", "name": "English"}, {"name": "Hindi"}, {"proficiency": "Native or bilingual proficiency", "name": "Gujarati"}, {"proficiency": "Native or bilingual proficiency", "name": "Kutchi"}, {"proficiency": "Elementary proficiency", "name": "Marathi"}], "_key": "IN5a00a1fc6526fd76", "image_url": "https://media.licd