", "organization": [{"unique_id": "fd0c4286156c6969", "name": "Newgen Software Inc", "profile_url": "http://www.linkedin.com/company/newgen"}]}, {"end": "July 2016", "description": "International and Domestic market (Financial domain)\n\n Exhibit Requirement Gathering Business Analysis, Process Consulting, Project Management Skills including project Scheduling, Monitoring coupled with structured inputs for optimal resource utilization, material management, cost rationalization and continuous improvement\n\n Worked closely with project stakeholders, SMEs, UX designer/s and staff to understand the requirements and specifications for new applications along with re-engineering the existing applications (Involve in Re-Engineering of certain Banking processes)\n\n Worked on consulting assignments involving preparation of Detailed Project Plan, Request for Proposal/tender documents.\n\n System requirement gathering and analysis, mapping of the processes and related knowledge into the workflow system. Integration points analysis between the workflow system, Middleware and the core systems\n\n Excellent writing skills in preparing business requirements documents (BRDs), system requirements specifications (SRS), system design specification (SDS), functional specifications, and defining project plans\n\n Strong Background in UML Modelling and Analysis: Created Use Case, Activity, Sequence, Data Flow, Business process modelling diagrams using Enterprise Architect and MS Visio.\n\n Conducting User Acceptance Testing (UAT) and verifying performance, reliability and fault tolerance issues. Also familiar with testing tools to design and develop test plans and test scripts.\n\n Work with the Project Manager to ensure all functional requirements, interactions are gathered and analyzed tasks are accurately planned within the overall agreed timeframes of the projects\n\n Creative and innovative thinker, with excellent communication skills bringing energy, enthusiasm and leadership to problem resolution\n\n Strives to do the \"right thing\", not just the \"easy thing\"", "title": "Senior Business Analyst", "start": "May 2009", "location": "Noida Area, India", "duration": "7 years 3 months", "organization": [{"unique_id": "fd0c4286156c6969", "name": "Newgen Software Technologies Ltd", "profile_url": "http://www.linkedin.com/company/newgen"}]}], "_key": "IN5a05f70ae61407ce", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/AAEAAQAAAAAAAAg2AAAAJDZmZmJjM2Y0LTkwZmEtNDAxNi1hMzI5LTRmYjQ3NmQzZWQ5Yw.jpg", "given_name": "Zainual", "skills": ["CCNA", "Six Sigma", "Lean Sigma", "Business Analysis", "Requirements Analysis", "Business Process Improvement", "Requirements Gathering", "Agile Methodologies", "SQL", "Project Management", "Business Process Design", "Software Project Management", "User Acceptance Testing", "XML", "Solution Architecture", "Business Intelligence", "Business Process Re-engineering", "Telecom BSS", "Functional Specifications", "Analysis", "Java", "Oracle Applications", "Test Automation", "Integration", "Business Requirements", "Team Management", "Consulting", "Gap Analysis", "Test Planning", "SDLC", "Vendor Management", "Business Process", "Pre-sales", "Key Account Management", "Benefits Negotiation", "Client Relations", "Sales Presentations", "Target Costing"], "unique_id": "5a05f70ae61407ce", "publications": [{"date": "2012", "publisher": "International journal of new practices in management and engineering", "authors": [{"url": "https://www.linkedin.com/in/zainual-bashar-6407ba18", "full_name": "Zainual Bashar"}], "summary": "This study focuses on the Consumer Perception of Retail outlets: A comparative study of Big bazaar and More mega store. With the help of consumer perception of retail outlets increase their sale and provide total customer satisfaction. These Retail Outlets increase the India as well as in all over the world The term consumer perception refers to the perception that consumers display in searching for purchasing, using, evaluating and disposing of products and services that they will expect will satisfy their needs.To study and compare consumer perception for Big bazaar as well as More Megastore. The sample size used in the study consists of 100 respondents of which 50 are consumer of Big Bazaar and 50 are consumer of more megastore retail outlets. The study conducted is analytic in nature aimed at finding out the consumer perception of retail outlets and Big Bazaar and More megastores. The conclusion of the study was that the suggestions were the increase After having analyzed interpreted the findings. It is concluded that consumer perception of retail outlets play a significant role to enhance the perception with consumers and provide total consumer satisfaction. It signifies that several factors, then after set hypothesis to accept and reject hypothesis. The dimensions factor like, PERSONALISATION, FACILITIES, RESPONSIVNESS, FLEXIBILITY, COURTESY, PRIVILIGES TO REGULAR CUSTOMER, EMPATHY, PARKING SPACE Which consumers get influenced about a big bazaar and More mega store, these are all the identified factor of Consumer perception of Retail Outlets in the study, increase the sell of retail outlet and create good brand image in the mind set of consumers.The study for future study is that is to feel up form with consumers sensuously and take interview of consumer, who walking in the shop floor of Retail Outlet. And to know in-depth psychology and perception of consumers, it will give better result for study.", "title": "Consumer Perception of Retail Outlets: A Comparative Study of Big Bazaar and More Megastores"}, {"date": "2011", "publisher": "International journal of business management and economic research", "authors": [{"url": "https://www.linkedin.com/in/zainual-bashar-6407ba18", "full_name": "Zainual Bashar"}], "summary": "Indian Carpet industry is primarily decentralized/unorganized sector, As the world trade opportunities are growing Indian carpet industry has to pace up with the world trade, for this we have to move from decentralized arena to an organized sector in order to achieve global opportunities & competitiveness. This paper is an attempt to explore capability of transformation to be brought about in the carpet industry through case study an industry situated in Rajasthan. There are many parameters to achieve this milestone; we have focused on the enterprise resource planning which plays important role in transformation. The research prerogative used is basically through case analysis & PESTEL study pre & post technological adoption. The results were establishing the technology adaptation help the organization to transform in areas of productivity level, supply chain, flow of work, quality, synchronization, optimum utilization of resources", "title": "Stimulating the Growth Trajectory of Indian Carpet Industry through Technological Intervention: A Case Study Approach"}, {"date": "2012", "publisher": "International Conference", "authors": [{"url": "https://www.linkedin.com/in/zainual-bashar-6407ba18", "full_name": "Zainual Bashar"}], "summary": "Human mind is considered as the memory warehouse with various combinations of thoughts, perceptions, emotions, will, imagination and all kind of conscious and unconscious cognitive processes. Mind creates perception for whatever it visualizes, feels and touches; and stores within itself for such a period of time till that perception is being reversed or modified. Positioning of brands is nothing but creating the perception within the minds of targeted customers. In marketing, positioning has come to mean the process by which marketers try to create an image or identity in the minds of their target market for its product, brand, or organization. Re-positioning involves changing the identity of a product, relative to the identity of competing products, in the collective minds of the target market. This article deals with the question whether the functional positioning or it\u2019s the emotional positioning which left its imprints on the minds of customers effectively, long-lasting and competitively with respect to the competitors. For example, whether the positioning of Tata Salt; Desh ka Namak (Emotional Positioning) is more effective than the positioning of DCW\u2019s Captain Cook; Free-flowing Salt (Functional Positioning)? How much impact does the Bajaj\u2019s Bike recent ads with the positioning statement; Ek litre me bharat ki khoj(Functional Positioning) has created or how much does Tata Tea impacted with the Jaago Re campaign (again, symbolic/emotional positioning)? The article will also going to cover number of caselets considering the effectiveness of positioning base, how much they impacted over the customers mind and for how long? The article will also cover the process (eight steps) involves in the creation of positioning of the brands/products. It will also cover how various firms have repositioned themselves from playing an emotional mind game to portraying its product attributes benefits, and vice versa.", "title": "Brand Positioning of High Involvement Category: What\u2019s Your Base?"}]}
