e_url": "https://www.linkedin.com/groups?gid=3793535"}, {"logo_url": "https://media.licdn.com/media/p/2/000/00a/1cf/06b15e2.jpg", "name": "eMarketing Association Network", "profile_url": "https://www.linkedin.com/groups?gid=41352"}, {"logo_url": "https://media.licdn.com/media/p/3/000/005/33f/0ec9426.png", "name": "SJCE Alumni Group", "profile_url": "https://www.linkedin.com/groups?gid=65034"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAdyAAAAJGVjYjk4YTQ0LTczZDItNDQwZS1iNWFiLTA0MmZmYjU3MmY2MQ.png", "name": "Renewable Energy World", "profile_url": "https://www.linkedin.com/groups?gid=2121068"}, {"logo_url": "https://media.licdn.com/media/p/2/000/00a/3b2/363137e.png", "name": "Uppsala University Alumni", "profile_url": "https://www.linkedin.com/groups?gid=118732"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAV5AAAAJDM3ZjUxMGZlLWMwYTgtNGE1ZS04NDdiLTA4NDgxYTc0OTQwYg.png", "name": "myBIO Community - Biotechnology connections", "profile_url": "https://www.linkedin.com/groups?gid=35214"}], "family_name": "Dasari", "volunteering": [{"opportunities": ["Skills-based volunteering (pro bono consulting)"]}, {"causes": ["Environment", "Science and Technology"]}], "locality": "Bengaluru, Karnataka, India", "headline": "Managing Director & Founder at DHST Consultants LLP", "industry": "Renewables & Environment", "last_visited": "2016-08-22T18:53:25", "num_connections": "500+", "experience": [{"end": "Present", "description": "We are system integrators and O&M service provider for commercial and residential rooftop SPV systems.", "title": "Managing Director", "start": "February 2014", "duration": "2 years 7 months", "organization": [{"unique_id": "868023c4f8d2379c", "name": "DHST Consultants LLP", "profile_url": "http://www.linkedin.com/company/dhst-consultants-llp"}]}, {"end": "July 2012", "description": "Studied sporadic breast cancer based on somatic structural variations.", "title": "Research Assistant", "start": "February 2012", "location": "Uppsala, Sweden", "duration": "6 months", "organization": [{"unique_id": "133edb47882226e0", "name": "Uppsala University", "profile_url": "http://www.linkedin.com/company/uppsala-university"}]}, {"end": "July 2008", "description": "Apple iTunes Store System Administrator", "title": "Assistant Systems Engineer", "start": "August 2006", "duration": "2 years", "organization": [{"unique_id": "ceb7e1f26bf4e1ae", "name": "Tata Consultancy Services", "profile_url": "http://www.linkedin.com/company/tata-consultancy-services"}]}], "summary": "Currently promoting Solar as a renewable energy source in India's energy mix. We are focusing on Bangalore, Karnataka to lead the charge in the development of rooftop solar for both commercial and residential buildings. We also provide additional O&M services along with all our installations. Our SPV system has a designed life of 25+ years and a limited warranty of upto 10 years. Available in the range of 2kW to 100kW along with our customized smart monitoring software suite.", "languages": [{"proficiency": "Native or bilingual proficiency", "name": "English"}, {"proficiency": "Native or bilingual proficiency", "name": "Hindi"}, {"proficiency": "Native or bilingual proficiency", "name": "Telugu"}, {"proficiency": "Professional working proficiency", "name": "Kannada"}, {"proficiency": "Elementary proficiency", "name": "Assamese"}, {"proficiency": "Elementary proficiency", "name": "Bengali"}], "_key": "IN5a06ecd7841a961a", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/p/8/005/0ae/2ca/10a5db8.jpg", "given_name": "Ravi Chandra", "url": "http://www.linkedin.com/in/ravi-chandra-dasari-42787636", "skills": ["Renewable Energy", "Solar System Design", "Solar PV", "Project Management", "Molecular Biology", "Bioinformatics", "PCR", "Biotechnology", "Cell Culture", "SDS-PAGE", "Genomics", "Lifesciences", "Protein Expression", "Sequencing", "Protein Purification", "DNA", "Protein Engineering", "Functional Genomics", "Protein Chemistry", "Western Blotting", "ELISA", "Life Sciences", "DNA sequencing", "Business Strategy", "Solar Energy", "Product Development", "Lean Startup", "Energy", "Engineering", "Management", "Business Development", "Start-ups", "Project Planning", "Team Management", "Strategic Planning", "Research"], "unique_id": "5a06ecd7841a961a", "publications": [{"publisher": "Genome Research", "title": "Signatures of post-zygotic structural genetic aberrations in the cells of histologically normal breast tissue that can predispose to sporadic breast cancer", "url": "http://genome.cshlp.org/content/25/10/1521.abstract", "summary": "Sporadic breast cancer (SBC) is a common disease without robust means of early risk prediction in the population. We studied 282 females with SBC, focusing on copy number aberrations in cancer-free breast tissue (uninvolved margin, UM) outside the primary tumor (PT). In total, 1162 UMs (1\u201314 per breast) were studied. Comparative analysis between UM(s), PT(s), and blood/skin from the same patient as a control is the core of the study design. We identified 108 patients with at least one aberrant UM, representing 38.3% of cases. Gains in gene copy number were the principal type of mutations in microscopically normal breast cells, suggesting that oncogenic activation of genes via increased gene copy number is a predominant mechanism for initiation of SBC pathogenesis. The gain of ERBB2, with overexpression of HER2 protein, was the most common aberration in normal cells. Five additional growth factor receptor genes (EGFR, FGFR1, IGF1R, LIFR, and NGFR) also showed recurrent gains, and these were occasionally present in combination with the gain of ERBB2. All the aberrations found in the normal breast cells were previously described in cancer literature, suggesting their causative, driving role in pathogenesis of SBC. We demonstrate that analysis of normal cells from cancer patients leads to identification of signatures that may increase risk of SBC and our results could influence the choice of surgical intervention to remove all predisposing cells. Early detection of copy number gains suggesting a predisposition toward cancer development, long before detectable tumors are formed, is a key to the anticipated shift into a preventive paradigm of personalized medicine for breast cancer.", "authors": [{"url": "https://www.linkedin.com/in/ravi-chandra-dasari-42787636", "full_name": "Ravi Chandra Dasari"}], "date": "August 2015"}]}
