 as part of consultancy assignments.\n \u2022Prepare responses to RFP's and other marketing collateral for the products offered by Risk Management Practice.", "title": "Senior Risk Analyst", "start": "May 2008", "duration": "1 year 11 months", "organization": [{"name": "D&B TransUnion Analytics and Decision Services Private Limited", "profile_url": "http://www.linkedin.com/company/d&b-technologiess-&-data-services-"}]}, {"end": "May 2006", "description": "\u2022 Experience in Manual and Automated software testing.\n \u2022 Involved in creation and execution of QA and testing processes, test strategies and plans, and bug documentation and regression.\n \u2022 Database and Data warehousing testing.\n \u2022 Automation of Test case design using MS Office Macros.\n \u2022 Administrator of Test Tools Lab.\n \u2022 Configuration Controller\n \u2022 Knowledge Management Activities", "title": "Software Test Engineer", "start": "July 2004", "duration": "1 year 11 months", "organization": [{"unique_id": "72ba034e608c6fdb", "name": "Infosys", "profile_url": "http://www.linkedin.com/company/infosys"}]}], "full_name": "Anand Radhakrishnan", "education": [{"end": "2008", "name": "Sri Sathya Sai Institute of Higher Learning", "summary": "Activities and Societies: Student In charge of Department Book Bank. Part of Student website development team.", "start": "2006", "degrees": ["M.B.A, Finance , Systems"], "profile_url": "http://www.linkedin.com/edu/sri-sathya-sai-institute-of-higher-learning-13632"}, {"end": "2004", "name": "Loyola College", "summary": "Involved in community welfare program called \"OUTREACH\".\n Was part of College NSS (National Service Scheme) team.", "start": "2001", "degrees": ["B.Sc, Mathematics"], "profile_url": "http://www.linkedin.com/edu/loyola-college-40449"}], "canonical_url": "http://in.linkedin.com/in/anandradhakrishnan", "groups": [{"logo_url": "https://media.licdn.com/media/p/1/000/0bd/320/1e0c093.png", "name": "IIBA (International Institute of Busi