rises automotive professionals with experience in core R&D for engine management calibration, automotive software and Connected Cars", "title": "Founder & CEO", "start": "2012", "duration": "4 years", "organization": [{"name": "EngineCAL"}]}, {"end": "2012", "description": "Engine & Vehicle Calibration, Vehicle Project Management", "title": "Assistant Manager", "start": "2007", "duration": "5 years", "organization": [{"unique_id": "11438159044896e5", "name": "Bosch Engineering and Business Solutions", "profile_url": "http://www.linkedin.com/company/bosch-engineering-and-business-solutions"}]}, {"end": "2007", "description": "Engine Development & Engine testing", "title": "Engineer", "start": "2006", "duration": "1 year", "organization": [{"unique_id": "02e614c20f0f6ad4", "name": "Force Motors", "profile_url": "http://www.linkedin.com/company/force-motors"}]}], "summary": "EngineCAL is now in the domain of Connected Cars. And so, perhaps, I doubt I may get an opportunity to do some of the fascinating things I mention below. But I wont remove or edit anything. It would be interesting to see how my own thoughts and ideas change as time and technology evolve.\n\n Meanwhile, my colleagues and I are going to do everything possible to develop unique algorithms for CarNET which uphold EngineCAL's philosophy - Safe, Clean & Efficient Motoring\n\n -------------------------\n\n My experience comprises Engine Development & Testing, Engine & Vehicle Calibration and Aftermarket performance tuning.\n\n I am keen to work on new generation fuel delivery systems coupled with Camless Engine Technology with Cylinder Deactivation. Such a system would help strike the fine balance required when aiming for advanced future emission norms and performance with frugality. While this has always intrigued me, it now appears that the last 4-5 years have seen Hybrid Systems evolve extensively, offering, perhaps, a more wholesome solution to this incessantly changing and challenging balancing act.\n\n On the engine & vehicle calibration front, it is heartening to see, just when I thought all has been squeezed out from present day engine and engine emission technology, that there may still be some tricks that can be pulled out from the 'Calibration Hat' before moving to the next step in engine & fuel systems modernization. Ofcourse, I speak of this only with respect to the Indian context.\n There lies a small opportunity for further calibration in the software considering the driving style of the end-customer and the environmental conditions. Series production Engine Management Datasets, which were further optimized using calibration strategies developed at EngineCAL, have shown lower CO2 figures and mild reduction in emissions as compared to their original certification values.\n\n\n http://in.linkedin.com/pub/enginecal-customized-calibration/44/ab1/1b8", "_key": "IN5a0a0ea6d08bafdb", "given_name": "Anubhav", "url": "http://www.linkedin.com/in/anubhav-amarnath-48a6155", "skills": ["Vehicles", "Motors", "Calibration", "Diesel Engine", "Automotive Engineering", "Automotive", "Pro Engineer", "Powertrain", "Simulations", "CAD", "Pre-purchase Inspections", "Engineering", "Testing", "FMEA", "PTC Creo", "CATIA", "Product Development", "Geometric Dimensioning & Tolerancing", "Manufacturing", "Management", "Automobile", "Continuous Improvement"], "unique_id": "5a0a0ea6d08bafdb", "publications": [{"url": "http://www.hindu.com/mp/2006/10/25/stories/2006102500610300.htm", "publisher": "AUTOCAR INDIA & Hindu October 2006", "authors": [{"url": "https://www.linkedin.com/in/anubhav-amarnath-48a6155", "full_name": "Anubhav Amarnath"}], "date": "October 2006", "title": "Solenoid Actuated Valve Train (SAVT)"}]}
