apacities and scope of other banking facilities to these entities\n \u2022 Gained insights into the steel and cement industries by conducting site visits to manufacturing facilities and providing regular updates to senior management via industry / company presentations\n \u2022 Major proposals handled:\n \uf0a7 - Advance Payment and Supply Agreement (APSA) trade structure facility of USD 30.0 million to a BVI based company from ICICI UK Plc\n \uf0a7 - ECB of USD 28.0 million as a part of syndication of USD 215.0 million to a steel manufacturing company for refinancing its existing rupee loan facilities\n \uf0a7 - Working capital facilities of Rs. 1.83 billion to a steel manufacturing company\n \uf0a7 - Bill discounting limits of Rs. 0.50 billion to a steel company for working capital purposes\n \uf0a7 - Debt restructuring implementation via the Joint Lenders\u2019 Forum route to restructure existing facilities of Rs. 2.40 billion assisted to a shipping company\n \uf0a7 - Arranged non-convertible debentures (NCD) of Rs. 7.50 billion for a realty company for its construction project", "title": "Relationship Manager", "start": "June 2011", "location": "Mumbai Area, India", "duration": "5 years 3 months", "organization": [{"unique_id": "6a93da226a1ace93", "name": "ICICI Bank", "profile_url": "http://www.linkedin.com/company/icici-bank"}]}, {"end": "June 2010", "description": "Undertaken a project to Compare the Workings of Regional Rural Banks, Co-operative Banks & Public Sector Banks\n Objective: To study and compare the workings of Regional Rural Banks, Co \u2013 operative Banks and Public Sector Banks w.r.t. to their growth and reach in the rural areas while understanding the customer levels of satisfaction and further expectations from these institutions.", "title": "Summer Intern", "start": "April 2010", "duration": "3 months", "organization": [{"name": "Mahindra & Mahindra"}]}, {"end": "June 2009", "description": "Fixed Income Technology Division\n Transition from