e & APAC geographies offering array of services like MPLS, IPLC, VOIP, Data centre, Voice over MPLS, Managed services/SAAS like CDN (Content Delivery Network), Hosted Contact Centre solution (cosmocom), Google Apps, Managed network security (Perimeter & End point), Email security, penetration testing & vulnerability assessment, Managed Hosting, Virtualization etc.", "title": "National Enterprise Manager", "start": "July 2008", "duration": "2 years 1 month", "organization": [{"unique_id": "9fe2dbede85ff326", "name": "Tata Communications Limited", "profile_url": "http://www.linkedin.com/company/tata-communication"}]}, {"end": "June 2008", "description": "Responsible for turning client retention & revenue/onward business penetration within set of assigned customer's through cross sell and upsell offering products and services from various OEM's like Netapp, EMC, Juniper, Cisco, Bluecoat, F5, Radware, Ironport etc. I was designated as a product champ ' under Major business drive in North region' within 3 month's of joining and was quite successful in shouldering it during my stint.", "title": "Major Account Manager", "start": "June 2007", "duration": "1 year 1 month", "organization": [{"unique_id": "e7c4b9eae8ac9090", "name": "Apara Enterprise Solutions (p) Limited.", "profile_url": "http://www.linkedin.com/company/apara"}]}, {"end": "May 2007", "description": "Worked as Territory Develpment executive, especially create business opportunities into untapped market to able to gain business penetratation, by virtue, contributed towards company's overall growth charter.", "title": "Territory Manager", "start": "May 2006", "duration": "1 year 1 month", "organization": [{"unique_id": "fcd04138e4a09e44", "name": "CMS Computers Limited (INDIA)", "profile_url": "http://www.linkedin.com/company/cms-computers-limited-india-"}]}, {"end": "May 2006", "description": "Worked as freelance software analyst primarily into Application testing aka application life cycle management & Object