tomation of various processes like Mapping and reporting using the concepts of SAS, Unix and Shell Scripting. The data collected from the clinical trials are sent to us for creation of usable datasets, creation of reports. We automate the process to achieve the target in the shorter span of time and adher to provide the best quality work to the Client.; Solution Environment SAS 9.1 With Unix\n\n\n\n\n Tools Base SAS, Macros, SQL, Unix, Shell Scripting, CDARS and Toad; Highlights Extensively using Base SAS and Macros to develop the various tasks/utilities to make the existing review process more efficient.\n Attended/Completed many trainings/sessions (including both on Pharma domain and SAS) to meet Client's requirements.\n Actively participating in process improvement drives.\n Producing nearly defect-free output by doing quality coding and review.\n I have received ON THE SPOT Award from TCS as well as TCS GEMS Appraisal from Client side for my dedicated effort.\n Was also involved in the preparation of test Cases while testing of the various automation tool prepared by my colleagues.\n I have Successfully completed my Base SAS and ISTQB Certification with Good Score.\n\n\n Project Data Mapping\n\n Customer Confidential", "title": "Statistical Programmer and Analyst", "start": "November 2009", "duration": "2 years 9 months", "organization": [{"name": "US Confidential Pharmaceuticals Giant"}]}, {"end": "July 2012", "description": "Description It is about transforming the raw clinical trail data into a specified target standard by writing SAS codes. Once transformed, various summary and listing reports have to be generated, which if matched with the reports available in Legacy documents, indicate a correct transformation.; Solution Environment SAS , Unix\n\n\n\n\n Tools Client's Internal Tools(CDARS)\n Base SAS, Macros, SQL, Unix, Shell Scripting; Highlights Extensively using Base SAS and Macros to map and analyze Client's Data into Client's format.\n\n Mapping data 