: "Biyani", "volunteering": [{"causes": ["Children", "Economic Empowerment", "Education", "Environment", "Health", "Poverty Alleviation", "Science and Technology", "Social Services"]}], "locality": "Bengaluru, Karnataka, India", "headline": "Student at Indian Institute of Management, Calcutta", "industry": "Mechanical or Industrial Engineering", "last_visited": "2016-08-22T18:53:52", "num_connections": "79", "experience": [{"end": "June 2016", "description": "\uf0a7 Worked with State Government on the development of greenfield Capital city with investment of USD 10 bn+\n \uf0a7 Built a first of its kind decision support tool to determine land price; Appreciated by the Chief Secretary of State\n \uf0a7 Benchmarked land area requirement across 15 uses; Successfully negotiated with industries for land allotment\n \uf0a7 Achieved saving of INR 200 Cr. for client through evaluation of 5 industry proposals; Awarded PPO \u201816", "title": "Summer Associate", "start": "April 2016", "duration": "3 months", "organization": [{"unique_id": "b454d04e4380461d", "name": "McKinsey & Company", "profile_url": "http://www.linkedin.com/company/mckinsey-&-company"}]}, {"end": "June 2015", "description": "\uf0a7 Worked with R&D Department to develop and validate a simulation model for testing new innovations of glow plug - an ignition device used in diesel engines for combustion\n \uf0a7 Constructed a dynamic simulation model of the glow plug to test and analyze any variant in < 6 minutes with results with ~98% accuracy\n \uf0a7 Achieved 20% cost reduction in testing new ideas and alterations for the product\n \uf0a7 Performed a study to understand the effects of 5 parameters on the performance of the glow plug and hence formulated possible alterations for the product\n \uf0a7 Designed and analyzed a single coil innovation for the product, increasing product efficiency by 15% and reducing cost by 20%\n \uf0a7 Co-ordinated with the manufacturing department and quality assurance department of the company to build prototypes for the single coil innovation\n \uf0a7 The functionality of the prototype was established. The innovation has been adopted by BOSCH to develop their product, using the idea to manufacture a new variety of glow plugs", "title": "Intern", "start": "January 2015", "location": "Bengaluru Area, India", "duration": "6 months", "organization": [{"unique_id": "fcf93563372d93f5", "name": "Bosch", "profile_url": "http://www.linkedin.com/company/bosch"}]}, {"end": "July 2014", "description": "\uf0a7 Worked on a project - \"Improvement in lifetime of engine valves\" at GE Global Research\n \uf0a7 Performed a complete patent analysis of over 900 patents of the various ideas and understood the importance of 6 factors on the lifetime of engine valves\n \uf0a7 Designed and analysed a unique system of rotary valves for intake and exhaust of gases\n \uf0a7 Increased air intake of the engine by 10% allowing greater power generation\n \uf0a7 Increased fuel efficiency of the engine by 6% and reduced emissions by 20%\n \uf0a7 Performed cost-benefit analysis and determined the business potential of the innovation\n \uf0a7 Performed an analysis of several materials suitable for increasing the lifetime of the valve", "title": "Summer Intern", "start": "May 2014", "location": "Bengaluru Area, India", "duration": "3 months", "organization": [{"unique_id": "76572dec01024f8e", "name": "GE", "profile_url": "http://www.linkedin.com/company/ge"}]}, {"end": "July 2013", "description": "Gained knowledge in the fields of Advance Helicopter Technologies in the Design Liaison Department, HAL-Helicopter Division\n Built an algorithm for flight regime recognition, identifying the current operating conditions of the helicopter. The algorithm was used by the institute to analyze the operations and performance of the helicopter. Assisted in load calculation and factor-of-safety analysis of various components of the helicopter", "title": "Intern", "start": "May 2013", "l