iding and Helping RM in Deals Closure and Negotiations\n - Data extraction or Lead Generation, Company's Websites and Online Data Portal like India Mart, Just Dial, Ask Laila etc\n - Used to Call on that data to fix meeting for Myself\n - Presentation - Face to Face interaction with Client to make them realize why E commerce is the future of Business.and Whats the importance of Digital Marketing in Online store Promotion\n - Meeting My the Sales targets and.Enabling my team so that they can achieved their Monthly Targets\n - Working parallel with Deliver team and Designer team to ensure the Online store Delivery occur on time and maintained accordingly\n - Relationship Management - Regular interaction with the clients to ensure a committed and partnership based relationship.\n Competitors Awareness - Understanding and keeping myself updated in the current market and about competitors. Market analysis In-depth experience and knowledge of wide Market/Customers & People\n\n - Good Team Player, keen to learn about the project and to recognize my potentiality in that project and try to utilize all the possible ways to get cent percent productive results at the end of the day.\n\n However, i am a team player to rely on for productive results.", "title": "Sr. Relationship Manager", "start": "October 2012", "location": "Gurgaon, India", "duration": "6 months", "organization": [{"name": "BoxBeat Technologies Pvt Ltd."}]}, {"end": "September 2012", "description": "- About BoxBeat Technologies - Its a Gurgaon based company which makes E commerce Portal for Retailer and Manufacturer so that they can do Online business as well.\n - My role involve Direct Sales Delhi NCR basis with following potential leads and qualifying opportunities with a focus on Manufacturing Vertical, Retails & Distribution etc. Maximizing every aspect of the client's needs using consulting approach Marketing, Email communication, including calling follow up, face-to-face meetings, proposals to close deals