": "Hyderabad, Telangana, India", "headline": "Mechanical Design Engineer Trainee at Cyient", "industry": "Aviation & Aerospace", "last_visited": "2016-08-22T18:55:29", "num_connections": "50", "experience": [{"duration": "3 months", "start": "June 2016", "organization": [{"name": "Cyient"}], "end": "Present", "title": "Mechanical Design Engineer"}, {"end": "June 2016", "description": "Shigemi Scientific Solutions is an Engineering Solutions startup company. It deals with industrial solutions using software like CATIA, ANSYS, FLUENT, SOLIDWORKS, NASTRAN, FORTRAN, HYPERMESH and so forth. The founder of this company, Mr Shivaji Ganesh Thota has over 15 years of experience working with multinational companies like Cyient, Izuzu, Nissan and Honda.", "title": "Senior Content Editor", "start": "May 2016", "duration": "2 months", "organization": [{"name": "Shigemi Scientific Solutions"}]}, {"end": "June 2016", "description": "I do freelance work at Upwork. My services offered include Editing, Copy writing, Proof-reading, Content updation and so forth. I specialise in offering high quality, error-free work with on-time performance & responsive communication with clients. My goal is to build a loyal client-base and to achieve an impeccable reputation on the website.", "title": "Freelance Editor", "start": "November 2015", "location": "Hyderabad Area, India", "duration": "8 months", "organization": [{"unique_id": "83be9564162ed364", "name": "Upwork", "profile_url": "http://www.linkedin.com/company/upwork"}]}], "summary": "I am an immensely talented professional with multidisciplinary experience. I have acquired several diverse skills in an effort to help bridge the gap between different avenues of life. I am a native English speaker, a publicly acclaimed speaker and a self proclaimed technology evangelist. I also am a professional musician(Piano, Guitar, Bass n Drums) with considerable experience as an audio-Engineer as well(Mixing and Mastering services).\n\n As far as formal education is concerned, I have a Bachelor's Degree in Aeronautical Engineering. I have also done many certification courses including\n\n > Business English Vantage (BEC) from the Cambridge University, UK\n > C, C++ and Data Structures from NIIT, Hyderabad\n > Java, Android Development, Cryptography and Python Courses from Udacity\n\n I have an avid interest in debates, elocutions, group discussions and so forth and have won several awards & achieved recognition from the following:\n > Won Best Speaker (Elocution) from Lions Club Hyderabad (2010)\n > Won Best Speaker (Debate) from Lions Club Hyderabad (2011)\n > Best speaker (Declamation) from United Nations (UN) (2011)\n > Won Best overall speaker in IOC competition (2014)\n > Won Best speaker & statewide 1st for elocution in the Hindu Inter-collegiate Competition (2014)\n\n Current Academic Achievements:\n > Published a technical paper in an International Conference (ICRAMAV-2014) at JNTU, Hyderabad\n > Organized workshops in Technical Fests dealing with Composite Materials.\n > Demonstrated working prototypes of Wireless Lighting Controls & was awarded the first project grant from my college's Entrepreneurship Development Cell (EDC)", "languages": [{"proficiency": "Native or bilingual proficiency", "name": "English"}, {"proficiency": "Professional working proficiency", "name": "Hindi"}, {"proficiency": "Professional working proficiency", "name": "Telugu"}], "_key": "IN5a12afaa689b7ed9", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/AAEAAQAAAAAAAAUwAAAAJGQ5YjkxOGQwLWFiY2UtNDcyNi05MjhiLTIwNGE5ZTRkNzdiMw.jpg", "given_name": "Stephen", "skills": ["Microsoft Excel", "Microsoft Office", "Microsoft Word", "PowerPoint", "Customer Service", "Research", "Public Speaking", "Leadership", "Strategic Planning", "Management", "Project Management", "Team Building", "Budgets", "Writing", "Professional Audio", "Editing", "Content Development", "Proofreading", "Copywriting", "Social Media", "Photoshop", "Communication", "Social Networking", "Marketing", "Teamwork", "C++", "Social Media Marketing", "Java", "Creative Writing", "C", "Team Management", "Engineering", "Aerospace", "AutoCAD", "Start-ups", "Process Improvement", "Strategy", "Program Management", "Data Analysis", "Market Research", "Press Releases", "Content Strategy", "Freelance Writing", "CATIA", "ANSYS", "Team Leadership", "SolidWorks", "Business Analysis", "Matlab"], "unique_id": "5a12afaa689b7ed9", "publications": [{"date": "November 2014", "publisher": "Elsevier", "authors": [{"url": "https://www.linkedin.com/in/stephen-netto-b09913106", "full_name": "Stephen Netto"}, {"url": "https://www.linkedin.com/in/ali-shabbir-6ba04158", "full_name": "Ali Shabbir"}, {"url": "https://www.linkedin.com/in/vrindesh-dalmiavrindesh365-51aa5a95", "full_name": "vrindesh Dalmiavrindesh365"}, {"full_name": "Niranjan Vojja"}], "summary": "The demand for MAV is rising rapidly, especially for smaller, lighter and stronger MAVs. But in order to reduce the size of the MAV and also make it lighter, the structural body of the MAV must be designed intricately and manufactured with precision. This is very hard to achieve using traditional machining and fabrication techniques. Hence in this paper, it is proposed that the manufacturing of MAV should be done using the newly evolved Fused Deposition Modeling Rapid Prototyping Technology by building a low cost and highly accurate 3D Printer. This 3D Printer can be used to manufacture structural components of MAV in a fast, accurate and a low cost manner.", "title": "Application of 3D Printing for fabrication of Micro Aerial Vehicle"}]}
