{"updated": "2016-08-20T14:10:26", "linkedin_id": "272954678", "also_viewed": ["http://www.linkedin.com/in/pushpendra-yadav-96a351114", "http://www.linkedin.com/in/udita-gupta-3135432b", "http://www.linkedin.com/in/sanjay-narola-a0b59218", "http://www.linkedin.com/in/medha-mishra-5144775b", "http://www.linkedin.com/in/kamlesh-suman-376a5387", "http://www.linkedin.com/in/jitendra-rajpal-35134b6a", "http://www.linkedin.com/in/rahul-soni-81044755", "http://www.linkedin.com/in/garry-zohrarian-a724b377", "http://www.linkedin.com/in/srishti-soni-31b97084", "http://www.linkedin.com/in/anil-prajapati-916972b2", "http://www.linkedin.com/in/dr-siddharth-saxena-b3aaa04b"], "full_name": "Garry Zohrarian", "courses": [{"organization": "Sambhav Social Service Organization", "competencies": [{"name": "MBA MBA"}, {"name": "Broadcasting Course Broadcasting Course"}, {"name": "Foundation Degree in Photography Foundation Degree in Photography"}]}, {"organization": "Devachan Enterprises Pvt. Ltd.", "competencies": [{"name": "Acting Grade 1 Acting Grade 1"}, {"name": "Digital Filmmaking Digital Filmmaking"}]}], "education": [{"start": "2006", "end": "2008", "name": "Sikkim Manipal University of Health, Medical and Technological Sciences", "profile_url": "http://www.linkedin.com/edu/sikkim-manipal-university-of-health-medical-and-technological-sciences-13624", "degrees": ["MBA, Marketing, A"]}, {"start": "2003", "end": "2005", "name": "ICFAI University", "degrees": ["Master of Business Administration (MBA), Human Resources Development, A"]}, {"start": "1990", "end": "2000", "name": "Air Force Vidya Bharati School, Gwalior"}], "canonical_url": "http://in.linkedin.com/in/garry-zohrarian-a724b377", "projects": [{"url": "http://www.youtube.com/watch?v=xRAp7V3--VU", "date": "January 2013 March 2013", "description": "Bhor is a movie about an individual \"Mr.Joginder Khanna\" , who is a reputed businessman of the city. Khanna decides to commit his life for the well being of children who have either lost their children or have been abandoned by their parents. Khanna sets up a small orphanage outside the outskirts of the city, where he provides children with a safe and upbringing environment. Manish, one of the boys scores well and heads for Kolkata for further studies. Seema is a painter who is adopted by a family and turns to a famous artist, while Vicky is arrested by police for killing a dhaba owner who tries to physically molest one of vicky's friend Raju. When Khanna disowns Vicky, Vicky promises to face Khanna only when once he can make Khanna proud of himself. Time passes away and Khanna ages. One day Vicky reads that Khanna is ill, and the trio goes to see him. He takes a promise from all three to take care of the children who are at the ashram. Khanna is being operated while the three head towards the ashram to be what Khanna had made of them, real \"Human Beings\"", "members": [{"url": "http://www.linkedin.com/in/garry-zohrarian-a724b377", "full_name": "Garry Zohrarian"}], "title": "Bhor - Shor Film"}, {"date": "March 2011 November 2012", "description": "Jan Satyagraha 2012 is a non-violent foot march organized by Ekta Parishad, on a 350 km stretch between Gwalior and Delhi. The march started at Gwalior on October 2, 2012, and arrived in Delhi on October 29, 2012. Jan Satyagraha means Keenness to Truth and is based on Mahatma Gandhi's non-violent resistance.\n The objective is to obtain a comprehensive National Land Reforms Act and effective implementation and monitoring institutions to provide access to land and livelihood resources to the poor landless, homeless and marginalized communities.[1] Ekta Parishad is also demanding implementation of PESA or Panchayats (Extension to Scheduled Areas) Act 1996 in tribal areas so that local population have a say in how the land and natural resources in their respective areas are used. They also demand fast-track courts to settle thousands of pending land disputes.\n After Janadesh 2007, Ekta Parishad demands included the implementation of the Forest Rights Act, 2008.\n Between September 20 and 24, several meetings took place between representatives of Ekta Parishad and government Ministers, but no agreement was reached.\n 50,000 landless and small farmers gathered in Gwalior on the Mela Ground on October 2, 2012. Jairam Ramesh, Minister of Rural Development, Government of India, Jyotiraditya Madhavrao Scindia, Member of Parliament from the Congress Party and Rajagopal P. V., president of Ekta Parishad, made speeches. Many other personalities were present.\n On October 8, a Ekta Parishad delegation met again with Ramesh in New Delhi.[2] An agreement was reached and the march stopped at Agra. The two major points of the agreement were:\n establishment of a draft national land reforms policy in the next 6 months, to be finalised soon thereafter.\n adoption of a legal provision to provide agriculture land to landless people and homestead land to homeless people", "members": [{"url": "http://www.linkedin.com/in/garry-zohrarian-a724b377", "full_name": "Garry Zohrarian"}], "title": "Jansatyagraha 2012"}, {"date": "May 2010 April 2013", "description": "\u2022 Training and Capacity Building of Staff and Community on the 8 Flagship Programs of the Government of India to ensure Right to Food\n \u2022 Communication and IEC Coordination\n \u2022 Monitoring and Evaluation\n \u2022 Networking and Advocacy\n \u2022 Reporting and Documentation", "members": [{"url": "http://www.linkedin.com/in/garry-zohrarian-a724b377", "full_name": "Garry Zohrarian"}], "title": "Sampannata Right To Food Project: Supported by Sir Dorabji Tata Trust"}, {"date": "October 2005 July 2009", "description": "\u2022 Training and Capacity building at Community and Staff Level to realize Water and Sanitation as a Basic Human Rights\n \u2022 Project Planning, Implementation and Monitoring\n \u2022 Reporting and Documentation\n \u2022 Financial Management", "members": [{"url": "http://www.linkedin.com/in/garry-