", "description": "Taking care of ADHD, Autistic, Down Syndrome Children.\n Special Education\n Activity and play with them", "title": "Intern", "start": "December 2011", "duration": "1 month", "organization": [{"name": "Savera Special School, SPARSH"}]}], "summary": "Research Scholar from Department of Psychology, University of Delhi. I have done my Post Graduation in Psychology from Department of Psychology, University of Delhi (2013-2015) and my Graduation in Psychology from Daulat Ram College (2010-2013). I have been awarded Junior Research Fellowship by the UGC. Before joining my PhD program in 2015 I was working with Taxmann Education Pvt. Ltd. as a Research Analyst. I have special training in the areas of child, developmental and counseling psychology as well as research. I have presented Research Papers at the Centenary Conference of Psychology, organized by University of Calcutta in October 2015, followed by a National Seminar organized by IIT-Delhi in 2016 and a National Conference organized by Keshav Mahavidyalaya of Delhi University. I have also been associated with UGC E-Pathshala project. I have worked with various NGOs for research purpose like Protsahan India Foundation, Sparsh and Samvedna Institute for Special Children. I have experience of working in the clinical set up (Sir Ganga Ram Hospital), especially in the area of neurodevelopmental disorders. I like to share my views on positive living through my blog- Breaking the Myths (link below). In short I am a research enthusiast who is inquisitive in nature, willing to explore, experience and learn.", "languages": [{"name": "Hindi"}, {"name": "English"}, {"name": "German"}], "_key": "IN5a1660f325a5c59a", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/p/7/005/081/08d/1995813.jpg", "given_name": "Chhavi", "skills": ["Psychology", "Counseling Psychology", "Mental Health Counseling", "Creative Writing", "Experience Working with Children", "Blogger", "Creative Arts", "Psychological Asses