iding these customers with technical product support and evaluating their project needs and specifications\n \uf0d8 Leverage Valve division project sales team, business units and industries group to develop and implement pursue strategies/tactic.\n \uf0d8 Consolidate and provide updated monthly projects forecast to upper management and Valve Division.\n \uf0d8 Work closely with Installed Base Service Team to leverage end-user influence.\n \uf0d8 Build up rapport and relationship with key accounts and key engineering contractors.\n \uf0d8 Develop new business opportunities in support to Valve division\u2019s initiative and strategies.\n \uf0d8 Research and develop market opportunities, monitor competition\n\n Major Services offered:\n Valves \u2013 General Maintenance, Safety Valve Repair , Test & Calibration , Valves \u2013 Preventative Maintenance , Valve \u2013 Repair & Refurbishment , Third Party Inspection & Testing Services , Actuator \u2013 Refurbishment , Equipment Customization , Pipe line Repair and Leak Containment Fabrication , Operator Customization , Custom Pipeline Fabrication Custom spares & Component Fabrication , Process Automation Consultation and Implementation , Machining Services , Fusion Bond Thermosetting Epoxy Coating , Leak Sealing , Onsite Services , Online Services .\n\n\n Major Clients Handled :\n Saudi Aramco, SABIC & its affiliates like Hadeed , Safco , GAS , Petrokemya etc.., SATORP JOML , S-CHEM , SIPCHEM , SAHARA , APC ,EPC Contractors , SWCC, Saudi Government, Semi-Government & other Multinational Companies.\n\n Major Project Handled:\n SATORP\n KARAN GAS PROJECT- SAUDI ARAMCO\n QURAYYAH SEA WATER INJECTION PLANT-SAUDI ARAMCO\n WASIT GAS PROCESSING FACILITIES-SAUDI ARAMCO- SUNG CHANG\n SWCC", "title": "Sales / Proposal Executive", "start": "2009", "duration": "5 years", "organization": [{"unique_id": "15bf0168b05061a9", "name": "PAN GULF VALVE SERVICES CO.LTD", "profile_url": "http://www.linkedin.com/company/pan-gulf-valve-services-co-ltd"}]}, {"end": "June 2009", "description": "Responsibilities:\n\n \u25cf Document Control\n \u25cf Keeping all record's confidentially\n \u25cf Follow up call's from client's\n \u25cf Prepare Memo's /Recruitment Letter's\n \u25cf Monitor all invoices everyday\n \u25cf Preparing Monthly report and monitoring the Sales of every Sales Engineer.\n \u25cf Keeping focus on Sales Collection from the Customer and informing the same to the Head of the department.\n \u25cf Prepare & Updating all Quotation's / Purchase order", "title": "Sales Coordinator", "start": "May 2008", "duration": "1 year 2 months", "organization": [{"name": "ALAA FOR INDUSTRIAL EQUIPMENT FACTORY"}]}, {"end": "January 2008", "description": "\uf0d8 Responsible for sales improvement by adopting different marketing strategies.\n \uf0d8 Product promotion.\n \uf0d8 Tracking complete control on customer service relationship.\n \uf0d8 Providing full support to sales team.\n \uf0d8 Traveling to visit customers and building a quick rapport with them;\n \uf0d8 Persuading customers our products will best satisfy their needs in terms of quality, price and delivery;\n \uf0d8 Co-coordinating sales projects;\n \uf0d8 Searching for new customers that could benefit from company products;\n \uf0d8 Taking part in trade shows, conferencing and marketing events;", "title": "Sales Executive", "start": "October 2006", "duration": "1 year 4 months", "organization": [{"name": "Getit Info Services"}]}], "summary": "Dear Sir,\n\n In pursuit of a challenging and rewarding job opportunity in the field of Sales & Marketing, I AYAZ AHMED SYED would like to extend my services for your organization.\n\n I am confident that my qualifications, experience and hard work along with my tendency to be responsible will certainly develop your interest in my profile. I hope you will favor me with an opportunity to work in your esteemed organization.\n\n\n\n\n Yours truly,\n AYAZ AHMED SYED", "languages": [{"name": "English"}, {"name": "Urdu"}, {"name": "Telugu"}, {"name": "Hindi"}], "_key": "IN5a167bb36b8e31f6", "given_name": "ahmed", "skills": ["Sincere, Hardworking, capable of taking independent decisions and handling criti", "Business Development", "Client Development", "Marketing Strategy", "Engineering", "Procurement", "Negotiation", "Petroleum", "Gas", "New Business Development", "Business Strategy", "Project Planning", "Oil & Gas", "Contract Negotiation", "Energy", "Project Engineering", "Petrochemical", "Management", "Project Management", "Team Management"], "unique_id": "5a167bb36b8e31f6"}
