.\n\n o Had been working as the editor for MMCC Results.\n\n o Had been working on different procedures of prior art searching, patent validity searching, and infringement.\n\n\n\n \uf0d8 From March 2007 to January 2009, worked extensively on patent searching.\n\n o During this time had good experience on different software\u2019s like Bio-rad, ISIS draw, Chem draw, etc.\n\n o Worked on Scifinder. I have a very good experience of searching in Scifinder. I used to get all the articles from different scientific journals in soft copies.\n\n o Prepared all catalogues of different compounds for our company.\n\n o Had been an associate editor for a monthly scientific journal called MMCC Results. For this journal I used to collect different articles from more than 30 different journals. I used to organize them according to an order, and then provide them to different scientists from different fields of work.\n\n\n \uf0d8 From October 2005 to April 2007, had been collecting the literature for various compounds from IICT Library.\n\n \u2022 During this time I learned to confirm a scheme for the synthesis of compounds.\n\n \u2022 Searching for alternate routes of synthesis for a compound.\n\n\n \uf0d8 As a Research associate performed wide array of reactions in Rational Labs from August 2004 to November 2005.", "title": "Field of work", "start": "August 2004", "duration": "12 years 1 month", "organization": [{"name": "Rational Labs"}]}], "url": "http://www.linkedin.com/in/siva-reddy-munagala-ba127235", "given_name": "siva reddy", "skills": ["Patent Litigation", "Patents", "Technology Transfer", "Laboratory", "Prior Art Search", "SciFinder", "ChemDraw", "Patent Applications", "Trademarks", "Patent Searching", "Intellectual Property", "Research", "Patent Prosecution", "Prosecution", "Trademark Infringement", "Patentability", "Intellectual Asset Management"], "_key": "IN5a1707c4b956c756", "unique_id": "5a1707c4b956c756"}
