{"updated": "2016-08-20T14:09:24", "linkedin_id": "142038051", "recommendations_preview": ["Ishan is a creative and original thinker. He is a quick learner and has an eye for detail that he applies while solving business problems. His insights as well as dedication to quality have made him an asset at work.", "I had an opportunity to work with Ishan at Fractal Mumbai. He is articulate in his communication, understands problem client is facing and works towards a feasible solution. He is an ace Business Analyst and demonstrated excellent problem solving skills and VBA automation techniques. He has sound knowledge of Spotfire, SPSS, SQL, Tableau, SPOTFIRE and QlikView. He is a team player and gem as a person."], "also_viewed": ["http://www.linkedin.com/in/ishan-khan-63696769", "http://www.linkedin.com/in/ishan-khan-83327480", "http://www.linkedin.com/in/ishan-khan-5a120531", "http://www.linkedin.com/in/aditi-agrawal-a31402a4", "http://www.linkedin.com/in/rishabh-mishra-305490a3", "http://www.linkedin.com/in/ganesh-counder-8b715b4b", "http://www.linkedin.com/in/sandeepreddyilluri", "http://www.linkedin.com/in/jb-constant-cpcu-6398965", "http://www.linkedin.com/in/ishan-khan-30b29630", "http://www.linkedin.com/in/taanya-khare-05286965", "http://www.linkedin.com/in/ishan-khan-09079336", "http://www.linkedin.com/in/anuja-ranjan-30459b3b", "http://www.linkedin.com/in/sucharith", "http://www.linkedin.com/in/tchakravarty", "http://www.linkedin.com/in/deepenti-jha-a9a36529"], "url": "http://www.linkedin.com/in/ishankhan", "full_name": "Ishan Khan", "education": [{"start": "2010", "end": "2012", "name": "Amity Business School", "profile_url": "http://www.linkedin.com/edu/amity-business-school-20490", "degrees": ["Master of Business Administration (M.B.A.), Supply chain Management"]}, {"start": "2006", "end": "2009", "name": "University of Mumbai", "profile_url": "http://www.linkedin.com/edu/university-of-mumbai-13663", "degrees": ["Bachelor of Science (BSc), Information Technology"]}, {"start": "2004", "end": "2006", "name": "Frank Anthony Public School", "degrees": ["HSC, Science"]}], "canonical_url": "http://in.linkedin.com/in/ishankhan", "groups": [{"logo_url": "https://media.licdn.com/media/p/3/000/00d/294/32377d0.png", "name": "Vendor Management Group", "profile_url": "https://www.linkedin.com/groups?gid=153755"}, {"logo_url": "https://media.licdn.com/media/p/1/000/062/0ac/1f50faf.png", "name": "USourceIT (RFP,IT outsourcing)", "profile_url": "https://www.linkedin.com/groups?gid=3167260"}, {"logo_url": "https://media.licdn.com/media/p/6/005/07a/025/1069ff0.png", "name": "Supply Chain Analytics", "profile_url": "https://www.linkedin.com/groups?gid=6738235"}, {"logo_url": "https://media.licdn.com/media/p/6/005/011/098/1d41f7a.png", "name": "Retail, Marketing and Customer Analytics", "profile_url": "https://www.linkedin.com/groups?gid=4371519"}, {"logo_url": "https://media.licdn.com/media/p/1/000/216/0bc/22c6f93.png", "name": "Strategic Sourcing & Procurement", "profile_url": "https://www.linkedin.com/groups?gid=139021"}], "family_name": "Khan", "certifications": [{"start": "March 2015", "certificate_authority": "Gsoft Computers", "end": "Present", "license": "License 010/12/8/2015", "title": "SQL Server 2008"}, {"start": "March 2015", "certificate_authority": "Netscitus Corporation", "end": "Present", "license": "License 15", "title": "SAS Certification"}], "locality": "Mumbai, Maharashtra, India", "headline": "Analytics professional", "industry": "Management Consulting", "last_visited": "2016-08-22T18:56:51", "num_connections": "500+", "experience": [{"end": "Present", "description": "Project Details :\n Spend Analysis for a client in CPG Domain.\n\n Job Role:\n 1). Extracting client data from disparate procurement data sources.\n 2). Performing quality checks on the data, identifying gaps in data and creation of error report summary.\n 3). Incorporation of data clarification provided by the data source owners.\n 4). Consolidating data from disparate sources on the basis of column mappings prepared between different sources.\n 5). Assigning commodity codes on the basis of taxonomies such as UNSPSC or custom taxonomies.\n 6). Normalizing and enriching supplier data to get the consolidated spend across suppliers.\n 7). Preparing spend cube for analysis across multiple dimensions using BIQ.\n 8). Analyzing spend data along with their payment terms, contract terms, time frames and other terms for finding potential savings opportunities.\n 9). Preparing Saving Opportunities reports at aggregated levels as well as transactional levels.", "title": "Business Analyst", "start": "April 2014", "duration": "2 years 5 months", "organization": [{"unique_id": "2d58e1d4a8ccc866", "name": "Fractal Analytics", "profile_url": "http://www.linkedin.com/company/fractal-analytics"}]}, {"end": "March 2014", "description": "Project Details:\n Analysis for Client Travel and Entertainment related spend and identifying Savings Opportunities in the Spend Data. Achieved Savings of 15 - 23% in the T&E Procurement Data by analyzing the Payment terms, Contract terms and industry analysis and trend.\n\n Job Role :\n \u2022 Setting of industrial benchmarks of various important categories through research across all industries and comparing client data with the set benchmarks.\n \u2022 Analysis of client PO/NON PO spend along with their payment terms, contract terms, time frames and other terms for finding potential savings opportunities..\n \u2022 Extracting client data from various data sources, linking and consolidating data into a single master file, cleansing and transforming data as per the analysis tool.\n \u2022 Classification of industrial data according to UNSPSC as well as custom taxonomies.\n \u2022 Developing custom sourcing taxonomies according to client sourcing needs.\n \u2022 Development of an authentic supplier database of more than 30k suppliers along with their product UNSPSC classification, contacts.\n \u2022 Assisting leads in preparing RFI/RFQs for sourcing needs.\n \u2022 Developing internal company tool for data extraction and enrichment of existing supplier data while coordinating with developers in the implementation process.\n \u2022 Reviewed 3000+ client contracts and identified savings and negotiation opportunities.\n \u2022 Thorough knowledge of various kinds of Supplier Audits.", "title": "Procurement Analyst", "start": "September 2012", "location": "Noida Area, India", "duration": "1 year 7 months", "organization": [{"unique_id": "8bf641f9e42ca1f9", "name": "Opera Solutions", "profile_url": "http://www.linkedin.com/company/opera-solutions"}]}], "summary": "Specialities : Spend Analysis (Data Cleansing, Line item Enrichment, Category Classification, Vendor Normalization), Strategic Sourcing, Vendor Risk Management, Vendor Audits, Contract Management, UNSPSC, Category Management - T&E, Data Harmonization, Data Visualizations, Dashboarding.\n Tools : Microsoft Excel 2010, Microsoft Access 2010, Microsoft Powerpoint 2010, SPSS, SQL 2005, BIQ v4.5, TABLEAU 8.1, qlikView.\n Team player with Strong Analytic, Solution Focused, Quick Learner, Knowledge Hungry and Exceptional Work Ethic.", "languages": [{"proficiency": "Full professional proficiency", "name": "English"}], "_key": "IN5a1873ba65f12762", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/AAEAAQAAAAAAAAgTAAAAJDNkZTRkNzE5LWNiZWUtNGJmOS05NzRhLTk1MmY4MGEyZDc2ZQ.jpg", "given_name": "Ishan", "recommendations": "6", "skills": ["Vendor Governance", "Vendor Risk Management", "Analytics", "Business Analysis", "Business Strategy", "Competitive Analysis", "Market Research", "Microsoft Excel", "Spend Analysis", "Strategic Sourcing", "Access Database", "Negotiation", "VBA"], "unique_id": "5a1873ba65f12762"}
