r 'Delta Finochem Pvt. Ltd.,Wadiwarhe, Nashik'. Project on \u2018Design For Centralization Of Chilling Plants\u2019 at \u2018Delta Finochem Pvt. Ltd., Wadiwarhe, Nasik\u2019. The objective of the study was to design a centralized chilling system by combining the existing two chilling plants and the comparative cost-effect analysis, efficiency was studied. The project was undertaken as a part of the final year BE curriculum.\n http://deltafinochem.in/", "members": [{"url": "http://www.linkedin.com/in/sagarkhatkale", "full_name": "Sagar Khatkale"}, {"full_name": "Sagar Jamdar"}, {"full_name": "Sagar Joshi"}, {"url": "http://www.linkedin.com/in/amol-khadamkar-a6b3b916", "full_name": "Amol Khadamkar"}], "title": "\u2018Design For Centralization Of Chilling Plants\u2019"}, {"date": "July 2010 June 2011", "description": "MEMS are electromechanical systems ranging in sizes from several to several hundred microns. These are widely used as sensors and actuators throughout industries. Common applications as proximity, ambient light, gyroscopic sensors in electronic devices such as laptops, smart-phones, tablets etc. This seminar was presented as requirement for the completion of the third year of BE curriculum.", "members": [{"url": "http://www.linkedin.com/in/sagarkhatkale", "full_name": "Sagar Khatkale"}], "title": "Seminar on \"Microelectomechanical Systems (MEMS)\""}, {"url": "http://bajasaeindia.org/", "date": "June 2011 December 2011", "description": "BAJA SAE is a national level inter-college competition sponsored by Mahindra and other automotive companies. The task is to manufacture an all terrain vehicle conforming to industry standards and propose a production and marketing model for its large scale production by a fictionalized firm. These vehicles are pitched and raced in a challenging terrain and the team with overall performance in design, reliability, manufacturing, discipline, innovation etc. is selected. Was a member (Documentation Incharge & Team Representative in the Virtual Baja (Design) Event held in Chennai.) of the NDMVP COE's team Autoczars 2012.\n http://bajasaeindia.org/", "members": [{"url": "http://www.linkedin.com/in/sagarkhatkale", "full_name": "Sagar Khatkale"}], "title": "Baja SAE 2012 (Autoczars 2012)"}], "groups": [{"logo_url": "https://media.licdn.com/media/p/1/000/031/279/093f206.png", "name": "PUMBA", "profile_url": "https://www.linkedin.com/groups?gid=2266594"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAeXAAAAJDFhZjUyYzFjLTEzZmItNGFiMy1iZjhmLTNkZTY5MWUzYTQ0OA.png", "name": "PUMBA Pune University MBA Alumni", "profile_url": "https://www.linkedin.com/groups?gid=929567"}, {"logo_url": "https://static.licdn.com/scds/common/u/img/icon/group/icon_group_100x50_v2.png", "name": "MBA Operations Freshers job", "profile_url": "https://www.linkedin.com/groups?gid=3720827"}, {"logo_url": "https://media.licdn.com/media/p/8/005/013/1c7/206426d.png", "name": "Department of Management Sciences (PUMBA) University of Pune", "profile_url": "https://www.linkedin.com/groups?gid=5182458"}, {"logo_url": "https://media.licdn.com/media/p/2/000/03d/1ba/0106742.png", "name": "AMW", "profile_url": "https://www.linkedin.com/groups?gid=2514414"}, {"logo_url": "https://media.licdn.com/media/p/7/005/046/39b/244a0f7.png", "name": "Mahindra Rise", "profile_url": "https://www.linkedin.com/groups?gid=6634393"}], "family_name": "Khatkale", "volunteering": [{"duration": "2 years", "start": "2014", "organization": [{"name": "Pune Marathon"}], "cause": "Health", "title": "Coordinator"}, {"organization": [{"name": "Pune Marathon"}], "cause": "Health", "causes": ["Arts and Culture", "Politics", "Science and Technology", "Social Services"], "title": "Coordinator"}], "locality": "Mumbai, Maharashtra, India", "headline": "Inventory Analyst & Purchasing Professional with Portescap", "industry": "Electrical/Electronic Manufacturing", "last_visited": "2016-08-22T18:56:49", "num_connections": "371", "experience": [{"duration": "1 ye