-38b930119", "http://www.linkedin.com/in/thameem-ansari-355732119"], "url": "http://www.linkedin.com/in/jahir-hussain-933650a6", "full_name": "Jahir Hussain", "courses": [{"organization": "Kumaraguru College of Technology", "competencies": [{"name": "Microprocessors and Microcontrollers Microprocessors and Microcontrollers"}, {"name": "Embedded Systems Embedded Systems"}, {"name": "VLSI design VLSI design"}, {"name": "Linear Integrated Circuits Linear Integrated Circuits"}, {"name": "Digital Electronics Digital Electronics"}, {"name": "Automotive Electronics Automotive Electronics"}, {"name": "Medical Electronics Medical Electronics"}]}, {"organization": "Nachimuthu Polytechnic College", "competencies": [{"name": "Electronics Circuits Electronics Circuits"}, {"name": "Analog and Digital Electronics Analog and Digital Electronics"}, {"name": "Microcontrollers and Embedded systems Microcontrollers and Embedded systems"}, {"name": "VLSI and Hardware Description Languages VLSI and Hardware Description Languages"}, {"name": "Comuter Hardware and Servicing Comuter Hardware and Servicing"}]}], "education": [{"start": "2013", "end": "2016", "degrees": ["Bachelor's degree, Electronics and Communications Engineering, 80"], "name": "Kumaraguru College of Technology", "summary": "Activities and Societies: Active member of Institute of Engineers, Active member of Society of Technical Education, Member of IQube."}, {"start": "2010", "end": "2013", "name": "Nachimuthu Polytechnic College", "degrees": ["Diploma, Electronics and Communications Engineering, 98"]}, {"start": "2006", "end": "2010", "degrees": ["Secondary School, 97"], "name": "Thirumathi Rukmaniammal Higher Secondary School", "summary": "Activities and Societies: Football, Long Jump, Runner"}], "canonical_url": "http://in.linkedin.com/in/jahir-hussain-933650a6", "projects": [{"url": "http://www.mybbb.esy.es", "date": "March 2016", "description": "Objective is to build a cloud connected device with Metal Oxide gas sensors which continuously measures the air pollution level with Optical based Suspended Particulate Matter measurement and post the data to cloud for storing and analysis. This device can be placed in a car or bicycle so that we can get a wider view of a city when compared to our current static monitoring stations.", "members": [{"url": "http://www.linkedin.com/in/jahir-hussain-933650a6", "full_name": "Jahir Hussain"}], "title": "Pollutant Visualizer"}, {"url": "https://www.youtube.com/watch?v=b6nnk0M4zOk", "date": "July 2014 March 2015", "description": "Wearable medical tracking devices are one of the growing technologies. It saves time and enables remote monitoring of patients by just wearing means. But main disadvantage of wearable devices is affordability. We decided to make a low cost, user friendly wearable health monitoring system. ECG, blood pressure, SPO2, Pulse, Temperature are the basic vital which are monitored and storing collected data's in to cloud. Doctors and caretakers can review the patients conditions remotely from anywhere.", "members": [{"url": "http://www.linkedin.com/in/jahir-hussain-933650a6", "full_name": "Jahir Hussain"}, {"url": "http://www.linkedin.com/in/shravan-subbaraman-0a6471105", "full_name": "Shravan Subbaraman"}, {"url": "http://www.linkedin.com/in/shrinath-k-4b3773a5", "full_name": "Shrinath K"}], "title": "Texas Instruments Innovation Challenge"}, {"date": "December 2014", "description": "Freescale Semiconductors conduct a Smart car racing every year in the name of The Freescale Cup (TFC). In 2014 we got selected based on our academic and technical validations we had given a car which consist of a servo for steering and high speed DC motors for propulsion and a 1X128 pixels CMOS line scan camera in front on the car to get feedback of path. We wrote a control loop (PID) which gets that camera as input, process it and finds error values. By passing this error values into the control loop we get proper control values to drive steering and propulsion motors", "members": [{"url": "http://www.linkedin.com/in/jahir-hussain-933650a6", "full_name": "Jahir Hussain"}], "title": "Freescale Smart Car Racing"}], "organizations": [{"position": "Student Member", "name": "Institute of Engineers", "start": "April 2014"}, {"position": "Student Member", "name": "Institute of Electronics and Telecommunication Engineers", "start": "April 2014"}, {"position": "Member", "name": "IQUBE", "start": "September 2013", "summary": "iQube is an Student Innovation and Incubation centre where students are provided proper guidance and resources to enhance their knowledge. Periodic training in hardware like Embedded systems, Analog design and software like Web development, Android development given to students to get them started with it. IQube has skilled software developers in various streams like android, web development and ethical hackers too. We often conduct hackathons to trigger students and to give them self confidence. To personally say i spend hardly three years here which make me to learn a lot more apart from academic classes."}], "certifications": [{"start": "February 2012", "certificate_authority": "Accel IT Academy", "end": "February 2013", "title": "Hardware and Networking"}], "volunteering": [{"description": "A satisfied experience on helping people who affected by flood in cuddalore district of tamilnadu. Lot of lessons rather than experience. The people is still unaware of the importance of education. Will do some boot camps to create awareness.", "title": "Flood Relief", "start": "December 2015", "duration": "9 months", "organization": [{"name": "Kumaraguru Action and Relief Empowerment"}], "cause": "Disaster and Humanitarian Relief"}, {"organization": [{"name": "Kumaraguru Action and Relief Empowerment"}], "cause": "Disaster and Humanitarian Relief", "description": "A satisfied experience on helping people who affected by flood in cuddalore district of tamilnadu. Lot of lessons rather than experience. The 