{"updated": "2016-08-20T14:09:11", "linkedin_id": "46448874", "also_viewed": ["http://www.linkedin.com/in/mahaleamit", "http://www.linkedin.com/in/amit-mahale-9b9bb02a", "http://www.linkedin.com/in/daya-solanki-08234131", "http://www.linkedin.com/in/amitmahale", "http://www.linkedin.com/in/ramdas-khanvilkar-39423b7a", "http://www.linkedin.com/in/rajeev-thakur-77705933", "http://www.linkedin.com/in/avinash-tupe-62bbb619", "http://www.linkedin.com/in/amit-mahale-b115801", "http://www.linkedin.com/in/chefajaychopra", "http://www.linkedin.com/in/pritam-naik-12a31876", "http://www.linkedin.com/in/dharmesh-katira-a301a56", "http://www.linkedin.com/in/akshay-gupta-3743097", "http://www.linkedin.com/in/mohit-nagpal-897ab165", "http://www.linkedin.com/in/harinder-sharma-4506672a"], "full_name": "Amit Mahale", "education": [{"start": "1996", "end": "1999", "name": "Academy of Culinary Education", "degrees": ["Diploma in Hotel Management, Hospitality Administration/Management"]}], "canonical_url": "http://in.linkedin.com/in/amit-mahale-17668013", "family_name": "Mahale", "locality": "Pune Area, India", "url": "http://www.linkedin.com/in/amit-mahale-17668013", "industry": "Hospitality", "last_visited": "2016-08-22T18:56:24", "num_connections": "500+", "experience": [{"duration": "9 months", "start": "December 2015", "organization": [{"unique_id": "9a571fb6664c4ae7", "name": "Serum Institute of India Limited", "profile_url": "http://www.linkedin.com/company/serum-institute-of-india-limited"}], "end": "Present", "title": "Manager Catering and Hospitality"}, {"end": "December 2015", "description": "Volkswagen is Europe's top brand and has aspirations of becoming no 01 global automobile company. VW has set up a green field car manufacturing plant in Chakan, Pune (India)\n\n Major responsibilities include effective execution of catering services, hospitality management & organising corporate events.\n\n Key Achievements -\n . Transformed the standards of industrial catering by implementation of HACCP standards in food hygiene and setting strict performance measures for service providers. Achieved ISO 22000, Food safety certification for catering operation.\n \u2022 Successful implementation of green field kitchen project with a budget of 1.2 million euros which serves in quality and with satisfaction 6, 000 employees everyday.\n \u2022 Reduced 27% of original designed space in central kitchen through VSM ( Value Stream Mapping) thus ensuring the most efficient layout for work.\n \u2022 Favourable audit report with good comments was achieved as against non compliance remarks last year in the ISO 14001 Surveillance audit.\n \u2022 Planning budgets and ensuring the functioning of daily operations of admin functions related to hospitality..\n . Ensuring continuous improvement in services & operation & resolving employee grievance.\n . Responsible for day to day management of the kitchen and canteens in coordination with the catering team, maintaining quality of the food, menu planning, maintaining hygiene and sanitation in the kitchen and canteens, ensuring food safety and nutrition, standardization of recipes, ensure proper handling and maintenance of kitchen and canteen equipment and infrastructure.\n . Internal auditor for EMS in kitchen and canteens.\n . 5S implementation in kitchen and canteens", "title": "Manager Catering and Hospitality", "start": "June 2012", "location": "Pune Area, India", "duration": "3 years 7 months", "organization": [{"unique_id": "8dcef8307126a62b", "name": "Volkswagen India", "profile_url": "http://www.linkedin.com/company/volkswagen-india"}]}, {"end": "June 2012", "description": "Responsible for leading the team of 40, including a team of 1 Sous Chef, 1 Master Chef, 7 Chef De Parties and 31 commis. The hotel is managed by the Concept Hospitality Ltd. Even though the room count is low the hotel has a tremendous Food and Beverage sale, which accounts for 60% of the total revenue generated. Seasons has 7 food and beverage outlets which include: The Galaxy Grill: a speciality European fine dining restaurant, Time Out: sports bar, Flavors: The Coffee shop, Cinnamon Spice: Indian speciality restaurant, Cakes And More: the pastry shop, Ti Amo: a gelato parlour and Council: the banqueting facility.\n\n Daily operations include: Handling of food and food cost through menu planning and ordering.\n Kitchen staff control. Constantly developing my staff, keeping discipline and an opened mind for people\u2019s suggestions and opinions. Taking time in appraising my staff correctly.\n Giving demonstrations of new dishes I want to implement and see that staff is trained for the same.\n Management of Kitchen plant \u2013 equipment and efficient use of machinery.\n Coordinating activities between the Food & Beverage service and production along with the Operations Manager. Fostering good outside contacts, speaking to guests in my restaurants and assisting in selling banquets.", "title": "EXECUTIVE CHEF", "start": "March 2009", "duration": "3 years 4 months", "organization": [{"unique_id": "e8885037725b7a61", "name": "Seasons - An Apartment Hotel", "profile_url": "http://www.linkedin.com/company/seasons---an-apartment-hotel"}]}, {"end": "March 2009", "description": "Responsible for opening 3 restaurants (Serengeti, Silver Metro and Zanzibar) and a banquet hall (Kabila) in Bangalore, setting up the entire kitchen, recruiting staff, setting and standardizing menus for all the 3 outlets along with the corporate chef. Serengeti is a 180 covers fine dining restaurant specializing in Peshawari, Awadhi and lukhnowi cuisine. Silver Metro is a 240 covers metro theme based multi cuisine restaurant which has a buffet setup for lunch and a la carte for dinner. Zanzibar is a wild life theme lounge bar serving fusion cuisine, varieties of tapas and finger foods.\n Used to head a team of 56, including a team of 1 Sous Chef, 7 Chef De Parties and 48 Commis.", "title": "Area executive chef", "start": "March 2008", "location": "Bengaluru Area, India", "duration": "1 year 1 month", "organization": [{"name": "Ohris Group"}]}, {"end": "March 2008", "description": "Lead the team of 56, including a team of 3 Sous Chefs, 2 Master Chefs, 3 Chef De Parties, 38 Commis and 9 Apprentice. The 36-room boutique hotel is India's only corporate Ecotel enterprise. It is managed by the Concept Hospitality Ltd.. Rodas has speciality oriental fine dining restaurant Far East, Event based restrobar Aura, The Coffee shop Parabola and Pavilion the banqueting facility.", "title": "Executive Chef", "start": "March 2007", "duration": "1 year 1 month", "organization": [{"unique_id": "9f4a2f9fbd449f15", "name": "Rodas an Ecotel Hotel", "profile_url": "http://www.linkedin.com/company/rodas-an-ecotel-hotel"}]}, {"duration": "1 year 1 month", "start": "March 2006", "organization": [{"unique_id": "b3cf430e89eaba33", "name": "Concept Hospitality", "profile_url": "http://www.linkedin.com/company/concept-hospitality"}], "end": "March 2007", "title": "Executive Chef"}, {"duration": "5 years 11 months", "start": "May 2000", "organization": [{"name": "The Orchid hotel, Mumbai"}], "end": "March 2006", "title": "Executive Sous Chef"}], "summary": "Progressive culinary professional with over 16 years of experience in establishments that include hotels, manufacturing industry, resorts, banquets and restaurants. Unique blend of creative flair and passion for food, strong business sense and engaging interpersonal skills. Strong record of streamlining operations and improving service while preserving the highest levels of quality. Natural ability to create enthusiastic, productive working environments with customer-oriented professionals. Highly skilled at performing financial analysis, troubleshooting operations and recommending effective cost controls.", "headline": "Manager Catering and Hospitality at Serum Institute of India (Pune)", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/AAEAAQAAAAAAAAlYAAA