rld Wide Travel Writers and Photographers", "profile_url": "https://www.linkedin.com/groups?gid=116271"}], "family_name": "Goswami", "volunteering": [{"causes": ["Animal Welfare", "Children", "Economic Empowerment", "Education", "Environment", "Health", "Human Rights", "Politics", "Social Services"]}], "locality": "Rajkot Area, India", "headline": "Administrator at JHP Galaxy Group", "industry": "Information Technology and Services", "last_visited": "2016-08-22T18:59:42", "num_connections": "500+", "experience": [{"duration": "1 year 5 months", "start": "April 2015", "organization": [{"name": "JHP Galaxy Group"}], "end": "Present", "title": "Administrator"}, {"end": "March 2015", "description": "Areas of Expertise:-\n * Maintain the personal files of all employees\n * Implement and follow the HR policy of the company..\n * Looking after recruitment process\n * Maintain the leave records of all employees.\n * Induction process for every new joiner in the company.\n * To circulate all policy decisions related with employees to them in a manner decided by the management.\n * Provide monthly attendance details to Accounts to process salary\n * Keep the record of attendance for each employee and check it on daily basis with computer attendance system.\n * Maintain leave records, verify eligibility of leave to get approval etc.\n * Maintain the database for potential employees.\n * Issue necessary Employment certificates\n * On the completion of one year of the service of the employee, need to do performance appraisal so maintain database for the same.\n * Responsible to prepare and present the performance report of each employee with the help of concerned HOD and submit the same to the Director/s for further action.\n * Keep up to date record of all circulars and orders issued by the concerned officers from time to time regarding the duties, timings, weekly off, holidays etc.\n * Look after Internal Audit for the quality work.\n\n Sourcing Techniques used:\n Passive:- Social Networking (LinkedIn, Facebook, Google SMS Chanel)\n Active:- Job Portals (Naukri, Monster), Reference Generation", "title": "HR. Manger", "start": "April 2011", "duration": "4 years", "organization": [{"unique_id": "07fef0ab0e4e9d7e", "name": "Zippro System Limited", "profile_url": "http://www.linkedin.com/company/zippro-system-limited"}]}, {"end": "May 2011", "description": "\u2022 Handling recruitment for junior/middle/senior management position.\n \u2022 Search new companies by direct visit for business development. I have covered the major area of Rajkot like GIDS, SAPAR.\n \u2022 Primary Responsible for sourcing of candidates for various types of companies and positions.\n o Types of Companies:- IT, Telecom, Petro-Chemical, Casting, Auto-Mobile, Trading, Finance, etc\u2026\n o Types of positions:- Head(Marketing, QC-QA, Finance, Production), Manager(HR&Admin, Account, Marketing, Production, QC-QA, Business Develop, Public Relation, Customer Care, Project ), CA, Engineers, Sales Exe, Marketing Exe, BD Exe, Account Exe, coordinator, I-phone Developer, Web-Developer, Web Designer, Graphic Designer, Front Desk, Back Office, Office Assistant, Tele-caller, etc\u2026.\n o Work Area:- India(Rajkot, Ahmedabad, Bengaluru), Africa (Madagascar, Johannesburg)\n \u2022 Sourcing Techniques used:\n o Passive:- Social Networking (LinkedIn, Facebook, Google SMS Chanel)\n o Active:- Job Portals (Naukri, Monster), Reference Generation\n \u2022 Formatting or modification of short-listing resumes suiting the requirement.\n \u2022 Conducting telephonic or personal interviews with candidate and getting preliminary information regarding salaries, abilities etc.\n \u2022 Arranging for telephonic/personal interviews or walk-in (line-ups) with the clients.\n \u2022 Communication & co-ordination with candidate &clients.", "title": "Recruitment Executive / Business Development Executive.", "start": "July 2010", "duration": "11 months", "organization": [{"name": "Gujarat Help Line"}]}], "summary": "Strong attention towards details, ability to meet deadlines, administrative skills, professional ethics, practical application of academic knowledge, Excellent communication, telephonic skills and being accurate, development of computer skills, work ethics, innovative thinking, working under minimum supervision and time management.\n\n Specialties: Specialties\n HR Development\n Recruitment\n Health and Safety\n computer work\n salary distribution\n ER,PF,GR work\n Contracts\n HRM\n Counseling\n Labour Welfare Activities\n Case studies\n employee Motivation\n Training and Development\n Joining formalities and\n Relieving procedures\n admin and other activities\u2026", "languages": [{"name": "English"}], "_key": "IN5a1b2757c14ac8b3", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/p/3/000/1f5/146/33ee786.jpg", "given_name": "Pankaj", "url": "http://www.linkedin.com/in/goswamipankaj", "skills": ["Recruitment", "Business Development", "HRM", "Recruiting", "Performance Management", "Personnel Management", "Employee Engagement", "Management", "Performance Appraisal", "Team Management", "Interviews", "Technical Recruiting", "Talent Acquisition", "HR Policies", "Sourcing", "Human Resources", "Social Networking", "Training", "Recruitments", "Talent Management", "Executive Search", "Succession Planning", "Employee Relations", "Workforce Planning", "Screening", "Payroll", "Employee Training", "HRIS", "Contract Recruitment", "Applicant Tracking Systems", "HR Consulting", "Internet Recruiting", "Organizational Development", "College Recruiting", "Employer Branding", "Team Building", "Onboarding", "Screening Resumes", "Temporary Placement", "Vendor Management", "Deferred Compensation", "Policy", "Strategic HR", "Benefits Negotiation", "Job Descriptions", "IT Recruitment", "Salary"], "unique_id": "5a1b2757c14ac8b3"}
