edia/AAEAAQAAAAAAAAIaAAAAJDZkZGYyZjJlLWRhNjUtNGU2Zi1iMWYxLTk1ZmVmOGE5ZTg2OA.png", "name": "Indian Biotech Jobs", "profile_url": "https://www.linkedin.com/groups?gid=1919330"}, {"logo_url": "https://media.licdn.com/media/p/3/005/09e/0ad/0549e90.png", "name": "Biotech and Pharma Professionals", "profile_url": "https://www.linkedin.com/groups?gid=87134"}], "honors_awards": [{"date": "July 2009", "organization": "Ranbaxy Appreciate Programme 2009", "description": "Awarded Certificate of Appreciation at the Ranbaxy Appreciate Programme 2009 for excellence in team effort for Generation and Validation of human 12-Lipoxygenase, which is not available commercially.", "title": "Certificate of Appreciation"}], "locality": "Bengaluru, Karnataka, India", "headline": "Manager- Insulin Program Management at Biocon", "industry": "Biotechnology", "last_visited": "2016-08-22T18:59:00", "num_connections": "210", "experience": [{"end": "Present", "description": "-Program Manager for global development of biosimilar insulin analogs\n -Prepare, track and manage project plan in MS Project and excel\n -Review programs with the team\n -Point of contact for client/vendor communications\n -Work with peers to continuously improve the project and program management function", "title": "Manager- Insulin Program Management", "start": "April 2016", "location": "Bengaluru Area, India", "duration": "5 months", "organization": [{"unique_id": "a4d166d127c23f20", "name": "Biocon", "profile_url": "http://www.linkedin.com/company/biocon"}]}, {"end": "March 2016", "description": "\u2022Alliance management, building, managing and sustaining relationships with external partners, CMOs, CROs, etc.\n \u2022Setting up and coordinating meetings with partners and internal stake-holders in advancing common program/ project goals.\n \u2022Interface with relevant functional groups, coordinating the timely execution of program activities including working with the technical and program teams and business development in identifying project risks.\n \u2022Preparing fully integrated program timeline and providing frequent updates on project goals to project teams and management.\n \u2022Responsible for communications and interactions with Governmental agencies in Malaysia.\n \u2022Manage program/ project team meetings.\n \u2022Drive communication to align program activities with corporate strategy, ensuring key decisions are made by Line Management and Senior Leadership to continue to progress plans forward and maintain communication with External alliances.\n \u2022Ensure timely preparation of reports and presentations on the related work and updating the same to the immediate to the Management, as required.\n \u2022To interact with other organizations and institutes regarding collaboration for process related technology development.\n \u2022To work as a team in close co-ordination with departments like QA, QC, Engg., Business Development, R&D and Manufacturing for maintaining quality standards and to have a continuous compliance as per the regulatory requirements.", "title": "Deputy Manager", "start": "February 2012", "duration": "4 years 2 months", "organization": [{"name": "Stelis Biopharma Pvt Ltd"}]}, {"end": "February 2012", "description": "\u2022Responsible for preparation of topical formulations using whey protein for both cosmetic as well as therapeutic applications.\n \u2022Worked at initial R&D scale preparation of nanoparticles of gold and silver which can be further used in topical formulations for wound healing.", "title": "Research Biologist", "start": "June 2010", "duration": "1 year 9 months", "organization": [{"unique_id": "09d5d7837ab8cfc8", "name": "Ranbaxy Biologics", "profile_url": "http://www.linkedin.com/company/ranbaxy"}]}, {"end": "June 2010", "description": "\u2022Cloned genes, expressed and purified proteins related to cancer, arthritis and metabolic and inflammation.\n \u2022Handled studies on characterization of Methicillin-Resistant Staphylococcus aureus and Klebsiella pneumoniae from various clinical isolates.\n \u2022Worked with Leishmania spp.\n\n Publications/Patents/Posters:\n\n Nucleotide sequence published in GenBank, titled \u201cAmplification and Cloning of G-protein coupled receptor (GPCR 40) from blood in Indian population\u201d.\n Authors: Singh, W., Sundaram, S., Kant, R. and Saini, K.S.\n Accession number: EF611308\n\n Nucleotide sequence published in GenBank, titled \u201cCloning and identification of new isoform of GSK3beta in human\u201d.\n Authors: Singh, W., Sundaram, S., Kant, R. and Saini, K.S.\n Accession number: EU302497\n\n Provisional Indian patent filed, titled \"PCR based insertion method to fix a mutated gene\".\n Inventors: Rajiv Kant, Winny Singh, Sindhuja Sundaram and Kulvinder Singh Saini\n Indian application no: 252/DEL/2008 Filing date: 29 January 2008.\n\n Identification of agonist for fatty acid receptor GPR40 for treatment of type II Diabetes.\n Geetha Vani Rayasam, Vamshi Krishna Tulasi, Sindhuja Sundaram, Winny Singh, Rajiv Kant, Joseph Alex Davis, Kulvinder Singh Saini, Abhijit Ray, Pradip Kumar Bhatnagar\n Poster presented at \u201cRamanbhai International Symposium\u201d 2009 at Zydus Cadila.\n\n Identification of Berberine as a novel agonist of fatty acid receptor GPR40.\n Geetha Vani Rayasam, Vamshi Krishna Tulasi, Sindhuja Sundaram, Winny Singh, Rajiv Kant, Joseph Alex Davis, Kulvinder Singh Saini and Abhijit Ray\n (Phytotherapy Research, Wiley Interscience, Vol 24, Issue 8, August, 2010).\n\n High Prevalence of Panton-Valentine Leukocidin (PVL) Genes in Nosocomial-Acquired Staphylococcus aureus Isolated from Tertiary Care Hospitals in Nepal.\n Bidya Shrestha, Winny Singh, V. Samuel Raj, Bharat Mani Pokhrel and Tribhuban Mohan Mohapatra\n (BioMed Research International, Volume 2014, Article ID 790350, Published 18 June 2014).", "title": "Senior Research Biologist", "start": "January 2008", "location": "Gurgaon, India", "duration": "2 years 6 months", "organization": 