_url": "http://www.linkedin.com/company/ramboll"}]}, {"end": "September 2015", "description": "Setting up the CAD System for various projects.\n Prepare and maintain CAD System containing procedures, production rules, methods, etc. to be followed.\n Prepare and maintain CAD Manual for the project describing the CAD System.\n Ensure that all the involved CAD Draftsmen are acquainted with and acts according to the instructions specified in this CAD Manual.\n Provide Training and Supervision of draftsmen to work on various projects.\n Checking the drawings for maintaining the quality of drawing as per the COWI standard.\n Performing CAD audits.\n Preparation of preliminary and detail design drawings for deep sewer tunnel i.e. alignment drawings, geotechnical drawings and structural (GA & RCC) drawings i.e. work shaft, access shaft, Non-Tbm Tunnel, Tbm-Tunnel, segmental lining and other detail drawings related to deep sewer tunnel.\n Preparation of Various drawings related to different Tunnel Projects.\n Preparation of reinforcement detailing drawing and bar bending schedule for different structures.\n Preparation general arrangement and detailed structural (RCC) drawings for culverts, bridges and marine structures.\n Editing detailed drawings / Revised checked drawings.\n Preparation of utility corridor drawings i.e. details plans, x-sections of placing ducts (IT, Power supply and LV) and detailing of the same.\n Image processing (Georeferencing, mosaicing, subsetting) using Erdas Imagine.\n\n Brief examples of projects executed: -\n\n\n STEP (Strategic Tunnel Enhancement Programme) Deep Sewer Tunnel Project, Abu Dhabi.\n Qatar Bahrain Causeway (Major Bridges), Qatar.\n Soderstrom Tunnel (Immersed Tunnel), Sweden.\n Development of Muscat & Salalah International Airports Project, OMAN.\n Gabbro Berth Expansion Project, Qatar.\n Ruwais Expansion Project, Abu Dhabi.\n Lusail Bridge Development Project, Doha, Qatar.\n Preparation of gis ready maps for Tata Chemicals ltd.\n