{"updated": "2016-08-22T19:02:13", "linkedin_id": "307935345", "also_viewed": ["http://www.linkedin.com/in/pavithrab", "http://www.linkedin.com/in/rishichandna", "http://www.linkedin.com/in/thyagujay", "http://www.linkedin.com/in/rajasukumaran", "http://www.linkedin.com/in/kishore-kumar-k-3a916387", "http://www.linkedin.com/in/abhilash-kumar-b-nagaraj-106a7113", "http://www.linkedin.com/in/meenakshi-m-40b88732", "http://www.linkedin.com/in/gomathiloganathan", "http://www.linkedin.com/in/umamaheswaris", "http://www.linkedin.com/in/gopinath-veeraragavan-a3750b1a", "http://www.linkedin.com/in/supriya-madan-4b015210"], "url": "http://www.linkedin.com/in/kishore-kumar-k-3a916387", "full_name": "Kishore Kumar K", "education": [{"end": "2014", "name": "University of Mysore", "summary": "-Participated in management events in, Indian Maritime university and won prizes\n -Participated in college level events, Social Welfare Activities.\n -Completed & Certified Sky Diving \u2013level 1(Beginner) from Singapore\n -Completed & Certified Six Sigma Certification (SSC)-GREEN BELT\n -Participated in Project Management Course in LIBA-Loyola", "start": "2012", "degrees": ["Master of Business Administration (MBA), Human Resources and Marketing"], "profile_url": "http://www.linkedin.com/edu/university-of-mysore-13664"}, {"end": "2012", "name": "SRM University", "summary": "-Awarded FIRST position in the event NET SLAM in 7th Sense\u201910,National level technical Symposium held at SRM university\n -Completed Microsoft ASP.NET Boot Camp Program (Pro metric ID: SR6383874)\n -Completed & Certified Honors Diploma in Computer Application", "start": "2008", "degrees": ["Bachelor of Technology (B.Tech.), Computer Software Engineering"], "profile_url": "http://www.linkedin.com/edu/srm-university-162118"}], "canonical_url": "http://in.linkedin.com/in/kishore-kumar-k-3a916387", "projects": [{"date": "April 2012", "description": "With the advent of cloud computing, data owners are motivated to outsource their complex data management systems from local sites to the commercial public cloud for great flexibility and economic savings. But for protecting data privacy, sensitive data have to be encrypted before outsourcing, which obsoletes traditional data utilization based on plaintext keyword search. Thus, enabling an encrypted cloud data search service is of paramount importance. Considering the large number of data users and documents in the cloud, it is necessary to allow multiple keywords in the search request and return documents in the order of their relevance to these keywords. Related works on searchable encryption focus on single keyword search or Boolean keyword search, and rarely sort the search results. In this paper, for the first time, we define and solve the challenging problem of privacy-preserving multi-keyword ranked search over encrypted data in cloud computing (MRSE). We establish a set of strict privacy requirements for such a secure cloud data utilization system. Among various multi-keyword semantics, we choose the efficient similarity measure of \"coordinate matching,\" i.e., as many matches as possible, to capture the relevance of data documents to the search query. We further use \"inner product similarity\" to quantitatively evaluate such similarity measure. We first propose a basic idea for the MRSE based on secure inner product computation, and then give two significantly improved MRSE schemes to achieve various stringent privacy requirements in two different threat models. To improve search experience of the data search service, we further extend these two schemes to support more search semantics. Thorough analysis investigating privacy and efficiency guarantees of proposed schemes is given. Experiments on the real-world data set further show proposed schemes indeed introduce low overhead on computation and communication.", "members": [{"url": "http://www.linkedin.com/in/kishore-kumar-k-3a916387", "full_name": "Kishore Kumar K"}], "title": "B.TECH Project Work \u201cPrivacy Preserving Multi-Keyword ranked search over encrypted cloud data\u201d done in HCL Career Development"}, {"date": "June 2014", "description": "Done an Market Survey Analysis on \"Commuter Profiling for Chennai Metro \" to check What public people having an awareness about Chennai Metro", "members": [{"url": "http://www.linkedin.com/in/kishore-kumar-k-3a916387", "full_name": "Kishore Kumar K"}], "title": "MBA Project Work Market search survey analysis \u201cCommuter profiling for Chennai Metro\u201d to respondents"}], "groups": [{"logo_url": "https://media.licdn.com/media/p/3/000/006/316/3f66d69.png", "name": "Magento Ecommerce", "profile_url": "https://www.linkedin.com/groups?gid=75041"}, {"logo_url": "https://media.licdn.com/media/p/8/005/093/069/04c1fa4.png", "name": "Hiring in India, USA, Hong Kong and Dubai", "profile_url": "https://www.linkedin.com/groups?gid=6550275"}, {"logo_url": "https://media.licdn.com/media/p/3/000/07c/3f1/30cd9f2.png", "name": "The Project Manager Network - #1 Group for Project Managers", "profile_url": "https://www.linkedin.com/groups?gid=37888"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAL6AAAAJGFkYWU3YTQxLWQ4OTMtNGVkNi1hZWI4LTcyMDVjZmU0ODMxOQ.png", "name": "Sharing our Resources", "profile_url": "https://www.linkedin.com/groups?gid=8317023"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAEhAAAAJDI0ZGMyMzFjLTVhY2QtNDNjYi1hNWU4LTY3MDJkNTM1MzFkMg.png", "name": "Business Development - Hunters IT", "profile_url": "https://www.linkedin.com/groups?gid=4159038"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAfPAAAAJDhmZGUwMjkwLWE0N2MtNDVmNi04NTI0LTg2ODEyYzhlNDlmZQ.png", "name": "DATA SCIENCE Professional & Executive Network \u2605 Scientist \u2605 Architect \u2605 Engineer \u2605 Analyst \u2605 Vendor", "profile_url": "https://www.linkedin.com/groups?gid=1922105"}, {"logo_url": "https://media.licdn.com/media/AAEAAQAAAAAAAAH6AAAAJDM1Yjc5MWRhLWQwODUtNDRkMi04ZmNhLT