nd fortnightly payment runs\n \uf0a7 Process bank payments and send remittance\n \uf0a7 SAP postings and clearing\n \uf0a7 Preparing forecast on daily basis for treasury\n \uf0a7 Perform Reconciliation\n \uf0a7 Reporting of monthly activities\n \uf0a7 Record new and maintain exception list of vendors\n \uf0a7 Perform Ad-hoc payment requests when required\n \uf0a7 Ensure all compliance and internal risk control measures are met\n \uf0a7 Reviewing the transactions processed by other team members.\n \uf0d8 Quality Management\n \uf0a7 Ensure 100% quality on processing.\n \uf0a7 Updating error analysis log in case of any errors and ensure errors are not repeated.\n \uf0d8 Team Management\n \uf0a7 Beaing an acting team lead, I am responsible for their trainings.\n \uf0a7 I need to ensure team members are updated on time about the process related updates.\n \uf0a7 Assisting team members for any assistance required related to process.\n \uf0a7 Active participation in fornightly or monthly con-call with the business units", "title": "Accountant - Cash Management", "start": "June 2014", "duration": "2 years 3 months", "organization": [{"unique_id": "75b15d1bbb1e33fb", "name": "Infosys BPO", "profile_url": "http://www.linkedin.com/company/infosys-bpo"}]}, {"end": "Present", "description": "\uf0a7 Process daily and fortnightly payment runs\n \uf0a7 Process bank payments and send remittance\n \uf0a7 SAP postings and clearing\n \uf0a7 Preparing forecast on daily basis for treasury\n \uf0a7 Perform Reconciliation\n \uf0a7 Reporting of monthly activities\n \uf0a7 Record new and maintain exception list of vendors\n \uf0a7 Perform Ad-hoc payment requests when required\n \uf0a7 Ensure all compliance and internal risk control measures are met\n \uf0a7 Reviewing the transactions processed by other team members.\n \uf0d8 Quality Management\n \uf0a7 Ensure 100% quality on processing.\n \uf0a7 Updating error analysis log in case of any errors and ensure errors are not repeated.\n \uf0d8 Team Management\n \uf0a7 Beaing an acting team lead, I am responsible for their trainings.\n \uf0a7 I need to ensure team members are updated on time about the process related updates.\n \uf0a7 Assisting team members for any assistance required related to process.\n \uf0a7 Active participation in fornightly or monthly con-call with the business units", "title": "Accountant - Cash Management", "start": "June 2014", "duration": "2 years 3 months", "organization": [{"unique_id": "75b15d1bbb1e33fb", "name": "Infosys BPO", "profile_url": "http://www.linkedin.com/company/infosys-bpo"}]}, {"end": "June 2014", "description": "\u2022 Dealing with one of the National general insurance brokers of AXA at UK. Ensure their accounts are reconciled before due date and payment sent on or before due date.\n \u2022 Maintaining debt ratio, due and overdue items count, CTA\u2019s, processing quality as per client\u2019s requirement.\n \u2022 Maintaining daily reports which come from UK and to ensure it is accesible to the team when required. Update reports as and when required for the team and managers.\n \u2022 Dealing with the brokers in relation to their monthly accounts and queries related to policies, policy lapses, commission related queries and chasing overdue items.\n \u2022 Working on the transversals assigned \u2013 Daily Queries and Query dashboard. Ensure that the daily query reports is prepared for the team to access and action upon and prepare monthly dashboard for the team and for UK.\n \uf0a7 Ensure 100% quality on processing.\n \uf0a7 Updating error analysis log in case of any errors and ensure errors are not repeated.\n \uf0a7 Error analysis meeting with the quality team on a monthly basis with the team.\n \uf0d8 Team Management\n \uf0a7 Maintaining the prediction sheet for the team members to predict the debt ratio of the team for the month, which is updated by the team members.\n \uf0a7 To ensure team members are updated on time about the process related updates.\n \uf0a7 Assisting team members for any assistance required related to process.\n \uf0a7 Maintaining a track of cash received from the brokers during month end for the team.\n \uf0a7 Working on one month overdue report to track the reason of outstanding policies and how to minimise the outstanding debt and count of policies\n \uf0a7 AXA has introduced online accounts settlement system for the brokers to save time and to ensure the payments received on time.\n \uf0a7 Part of three member team of E-Settlement. Targetting the brokers to convert them on online accounts settlement system. Successflly over achieved target for the last quarter.\n \uf0a7 Rewarded best employee of the month twice and five appreciation certificates.", "title": "Specialist", "start": "June 2011", "duration": "3 years 1 month", "organization": [{"name": "AXA Business Services"}]}], "_key": "IN5a249cb6e3500b38", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/AAEAAQAAAAAAAAEqAAAAJDM5YzhjNTg1LTJkZjYtNDY0OC1hMzFjLTU1NzA0MWUwNjc5Zg.jpg", "given_name": "Pravin", "skills": ["finance and accounts", "Accounts Payable & Receivable", "Cash Management", "Investment Advisory", "Management", "Microsoft Office", "Customer Service", "Process Improvement"], "unique_id": "5a249cb6e3500b38"}
