 for all projects.", "title": "Creative Writer", "start": "January 2009", "duration": "2 years 6 months", "organization": [{"unique_id": "056b15bac5020b6f", "name": "Games2win India Pvt Ltd", "profile_url": "http://www.linkedin.com/company/contests2win.com"}]}, {"end": "December 2008", "description": "Planned and wrote editorial features for each issue.\n\n Edited pieces submitted by freelance contributors.\n\n Supervised the design team on the magazine\u2019s layout.\n\n Managed JAM\u2019s (then) social networking site.", "title": "Features Writer", "start": "June 2008", "duration": "7 months", "organization": [{"name": "JAM Venture Publishing Pvt. Ltd."}]}, {"end": "May 2008", "description": "Helped the internal team crack briefs on TVCs and various other small print campaigns.\n Wrote copy for brochures, print campaigns, etc.", "title": "Trainee Copywriter", "start": "February 2008", "duration": "4 months", "organization": [{"unique_id": "0d3d71a92b583796", "name": "Lowe Lintas", "profile_url": "http://www.linkedin.com/company/mllintasgroup"}]}, {"end": "December 2007", "description": "Wrote copy for brands\u2019 literature including corporate websites, brochures, etc.", "title": "Part-time Copywriter", "start": "July 2007", "duration": "6 months", "organization": [{"name": "DesignHub Pvt Ltd"}]}], "summary": "I am passionate about digital and technology, and keen on making it useful for businesses and their consumers.\n\n For over 6 years, I have worked in various capacities in creating digital experiences for users and audience of products and brands. They include:\n Online gaming - Creative lead on developing flash games, mobile games, and virtual worlds.\n\n Full-fledged digital campaigns - Strategising and ideation on websites, digital media innovation, social media engagement.\n\n Content and marketing for SaaS products - Email marketing, lead nurturing campaigns, technical content, SEO strategy, copy for product interfaces.\n\n New product developments - Creative and design thinking on layouts, wireframes and features of products in development.\n\n Basic web data analysis.", "languages": [{"name": "Hindi"}], "_key": "IN5a272097d0ebeed9", "image_url": "https://media.licdn.com/mpr/mpr/shrinknp_200_200/p/7/005/095/035/08c2bac.jpg", "given_name": "Tamanna", "skills": ["Creative Writing", "Creative Solutions", "Social Media", "Digital Marketing", "Digital Strategy", "Integrated Marketing", "Creative Strategy", "Online Advertising", "Digital Product Development", "CRM", "Editing", "Copywriting", "User Experience", "Social Media Marketing", "Digital Media", "User Research", "Marketing", "Content Strategy"], "unique_id": "5a272097d0ebeed9", "publications": [{"publisher": "Red Bull", "title": "#TweepsWithWings \u2013 Varun Patra From a digital agency to a start-up, all in 24 years!", "url": "http://www.redbull.com/in/en/stories/1331616172051/tweepswithwings-%E2%80%93-varun-patra", "summary": "If you have been keeping up with the alternative culture, it\u2019s impossible that you haven\u2019t heard about Homegrown yet. We thought it will be great to follow @VarunPatra, one of its founders. Here\u2019s a low-down on why, what and how about Homegrown and Varun Patra.", "authors": [{"url": "https://www.linkedin.com/in/tamannajaisinghani", "full_name": "Tamanna Jaisinghani"}, {"url": "https://www.linkedin.com/in/varun-patra-3772ba26", "full_name": "Varun Patra"}], "date": "October 2014"}, {"publisher": "redbull.com", "title": "He Tried To Climb And Conquer The World Cup At 20", "url": "http://www.redbull.com/in/en/adventure/stories/1331691355987/he-tried-to-climb-and-conquer-the-world-cup-at-20", "summary": "Kumar Gaurav is a lead climber from India. He has climbed in more World Cups than you.", "authors": [{"url": "https://www.linkedin.com/in/tamannajaisinghani", "full_name": "Tamanna Jaisinghani"}], "date": "November 2014"}]}
