Company", "profile_url": "http://www.linkedin.com/company/nalco"}]}, {"end": "October 2006", "description": "IMC Ltd. is a private monopoly in tank terminal operations having liquid storage tank terminals in all Indian ports. They specialize in storage & transport of petroleum and chemicals.\n\n - Responsible to carry out day-to-day terminal operation safely.\n - Scheduling & implementing daily, weekly, monthly & yearly maintenance activities.\n - Establishing reports pertaining to ISO standards for maintenance.\n - Assisting Terminal manager in administration activities; coordinating with customers & logistics and finalizing AMC contracts, tenders.\n - Worked with customers like Reliance, Essar, IOC Ltd, TPL, HPL etc.\n - Expertise in storing & Handling Class A Products, Petrochemicals, chemicals, edible oils etc.\n - Key player in shipment activities (export & import).\n - Meticulous experience in pipeline transfer, pigging operation, unloading and loading operations etc.\n - Loading and Unloading of Petroleum and other chemicals from port to tank terminals and from terminals to customer sites.", "title": "Assistant Manager", "start": "December 2004", "duration": "1 year 11 months", "organization": [{"name": "IMC Ltd"}]}, {"end": "December 2004", "description": "- Responsible for process operation of Cooling Water and Waste Water Treatment Plant.\n - Worked in ETP plant and knowledgeable on all the operations & service stages.\n - Worked in Reliance Jamnagar and IPCL Baroda sites, responsible for managing cooling system operations including chemical treatment, monitoring, and reporting.\n - Expertise in troubleshooting, battery limit (B/L) survey, lab analysis and computer application.\n - Successful commissioning of Chlorine Dioxide (ClO2) generator for microbial control.", "title": "Technical Specialist", "start": "October 2001", "duration": "3 years 3 months", "organization": [{"unique_id": "5917a8d87700b995", "name": "GE Betz India Ltd.", "profile_url": "http: